INSERT INTO `studios` (`id`, `city_id`, `suburb_id`, `title`, `address`, `description`, `classes_description`, `phone`, `website`, `email`, `meta_title`, `meta_description`, `meta_keywords`, `lat`, `lng`, `visible`, `created`, `modified`) VALUES
(1, 1, 788, 'Anahata Yoga Studio', 'Unit 2A Level 1, 94 Marine Parade', '<p>Anahata Yoga Space is a small, stunning, purpose built studio overlooking Maroubra Ocean catering for around 14 people per class assuring the care you have paid for.\r\n</p><p>\r\nSituated across the road from the magnificent Mahon rock pool and above the Pool Caf on the Northern Headland of Maroubra Beach. \r\nYou will see dolphins and whales breach in their passing seasons, sunrise and moonrise directly in front of your eyes. </p><p>The air is clean, ambience clear and calming - an absolute city retreat. \r\n\r\nWith unlimited parking lot across the road and bus stops only metres away you can be assured a calm arrival.</p>', '', '0411 494 926', 'anahatayogaspace.com.au', 'anahatayogaspace@gmail.com', 'Classhopper | Anahata Yoga Space', 'Natalie''s classes are gentle yet strong, working with core muscle, asana, pranayama, bhandas, meditation and visualisation. You do not need to be an expert or extremely flexible as the classes are adjusted to each individual. These classes are not floor gymnastics; they are designed to integrate body, mind, spirit and soul, bringing the entire being into a healthy state, enabling you to unravel your potential.', 'yoga, anahata, tai chi, sydney, coogee', -33.94268350, 151.26212597, 1, '2015-05-08 13:49:15', '2015-05-19 06:35:27'),
(3, 1, 743, 'Outdoor Squad @ Alexandria', 'Alexandria Park, Buckland St Alexandria NSW 2015', '<p>We work with people of all ages and fitness levels to provide accountability, support and motivation in a fun bootcamp fitness session.\r\n\r\nOur highly qualified trainers use the latest in sports science to make your boot camp experience productive, varied and enjoyable.\r\n</p><p>\r\nIf you want to get fit, lose weight, tone up and improve your strength, we can help you like weve helped others.\r\n\r\nUsing functional fitness tools including kettlebells, powerbags, dumbbells, battleropes, medicine balls, TRX suspension training, high intensity cardio drills including circuits, sprints, relays, intervals, hill and stair training, plus our popular non-contact boxing and kickboxing drills, you will experience a cross training effect like no other.\r\n</p><p>\r\nOur clients use the unique training at Outdoor Squad to simply improve their life. Some come to improve their mood, reduce stress, meet new people, have more energy. Others use the training to enter fun runs, marathons, obstacle races such as Tough Mudder and Spartan Race, Ironman, and generally train a better body to do more and go further.</p>', 'test.', ' 0409 537 743', 'http://outdoorsquad.com.au/', 'info@outdoorsquad.com.au', 'Classhopper | Outdoor Squad Alexandria', 'We work with people of all ages and fitness levels to provide accountability, support and motivation in a fun bootcamp fitness session.', 'bootcamp, outdoor squad, alexandria, sydney, fitness, wellness, kettlebells, powerbags, dumbbells, battleropes, medicine balls, TRX suspension training, high intensity cardio drills including circuits, sprints, relays, intervals, hill training, stair training', -33.90027046, 151.19753838, 1, '2015-05-10 06:15:44', '2015-05-18 09:53:25'),
(4, 1, 934, 'Sarah Brikke Zumba @ Manly', '44 Market Lane Manly NSW, 2095', '<p>Anyone can do Zumba! No need for previous dance experience. Just come as you are. \r\n\r\nPlease bring a towel, water, sport shoes (please NO BLACK SOLES), gear to do sport in and of course your awesomeness and beautiful smiles. </p><p>See you on the dance floor to party!!!\r\n\r\nThe Manly Hub / Painters Gallery is on 44 Market Lane, located just at the back of the Corso - next to the Manly library &amp; Saltmotion Gallery. \r\n\r\nPlease check in at the front desk 10min before the class starts. </p>', '', '0481244996', 'http://sarahbrikke.zumba.com/', 'sarahbrikkezumba@gmail.com', 'Classhopper | Sarah Brikke Zumba', 'Anyone can do Zumba! No need for previous dance experience. Just come as you are. ', 'zumba, zumba united, sarah brikke, fitness, dance, movement, rhythm, workout, manly, party, active, casual, sydney', -33.79797937, 151.28710270, 1, '2015-05-10 06:21:30', '2015-05-16 17:08:51'),
(5, 1, 767, 'Yoga By The Sea', '1 Notts Avenue, Bondi Beach NSW 2026', 'Harmonise body, mind and soul in an oceanic setting...\r\n\r\nThe traditional art of YOGA has been practiced for 5000 years to relieve stress, expel negative energy, detoxify organs, build inner core strength, improve the nervous system and enhance wisdom, fitness and flexibility. The series of stretching and ''prana'' (breathing) exercises are designed to both challenge and relax, while stimulating focus, balance and positive life force.\r\n\r\nOn a deeper level, yoga is a state of being in which all apparent opposites, distinctions and states are reconciled. From this state of union we live without fragmentation or inner conflict. We are able to embrace our whole being from the surface to the depths, encompassing both our transient limitations and our perennial limitlessness. We honour and live from, by, and within our true nature. This is the key to a life of peace and contentment.', '', '', '', '', '', '', '', -33.89527140, 151.27441410, 1, '2015-05-10 06:26:30', '2015-05-15 13:09:11'),
(6, 1, 814, 'Latin Motion - St Peters', '15 May Street, St Peters NSW 2044', 'Latin Motion is not just another Latin dance school; we are a community connected by a passion for dance. We live and breathe dance and have heaps of fun together, day in day out.\r\n\r\nWe want to inspire the dancer that lives in everyone by nurturing creativity, self-esteem and self-confidence. We do that by providing every student with a solid foundation for dance and helping them to discover their passion and strengths.\r\n\r\nWith over 20 years of dance teaching experience, we are dedicated to developing talent at both the recreational and professional levels, through our public classes and our Academy program.\r\n\r\nOur public classes range from absolute beginners to the most advanced level. All our instructors are hand picked & trained by Oliver Pineda, 8 x World Salsa Champion, on the most effective method of teaching, getting our students to dance like they never thought they would!', '', '', '', '', 'Classhopper | Latin Motion St Peters', '', '', -33.90867640, 151.18088722, 1, '2015-05-10 06:31:44', '2015-05-15 12:25:27'),
(7, 1, 721, 'Latin Motion - Classes in the Sydney CBD', 'Shark Hotel, Level 2, 127 Liverpool Street, Sydney', 'Latin Motion is not just another Latin dance school; we are a community connected by a passion for dance. We live and breathe dance and have heaps of fun together, day in day out.\r\n\r\nWe want to inspire the dancer that lives in everyone by nurturing creativity, self-esteem and self-confidence. We do that by providing every student with a solid foundation for dance and helping them to discover their passion and strengths.\r\n\r\nWith over 20 years of dance teaching experience, we are dedicated to developing talent at both the recreational and professional levels, through our public classes and our Academy program.\r\n\r\nOur public classes range from absolute beginners to the most advanced level. All our instructors are hand picked & trained by Oliver Pineda, 8 x World Salsa Champion, on the most effective method of teaching, getting our students to dance like they never thought they would!', '', '0422 030 184', 'http://www.latinmotion.com.au/', 'info@latinmotion.com.au', 'Classhopper | Latin Motion CBD', 'A dance company that provides a syllabus of Latin dance classes around Sydney, Australia.', 'latin dance, latin motion, salsa, classhopper, cbd, sydney, nsw', -33.87686481, 151.20809555, 1, '2015-05-10 06:35:22', '2015-05-16 03:38:54'),
(8, 1, 949, 'Be Still and Chill', 'Suite 206 658 Pittwater Rd, Brookvale NSW 2100', 'Our aim is to bring balance & clarity to your life today, allowing inspiration & positivity to grow for life tomorrow.\r\nMatt Omo & Michele Baker-Omo have been practising & teaching health & wellness collectively for over 25 years both in Australia, Peru, US & UK. They are passionate about living their dreams, sharing their passions & living a sustainable life. They created Be Still & Chill Health and Wellness Centre with the intention of bringing a group of Caring Professionals into a peaceful place to support you in creating a healthy Mind, Body and Spirit....Naturally.	\r\n\r\nMichele is a passionate Remedial Massage Therapist, Level 2 APMA Pilates Instructor and member of ATMS and APMA who specialises in womens health & injury rehabilitation.\r\n\r\nMatt is an experienced Sound & Energetic Healer, Cert. Kundalini Yoga Teacher with a Master''s Degree in Spiritual Psychology.', '', '', '', '', '', '', '', -33.76345080, 151.27186775, 1, '2015-05-10 06:48:25', '2015-05-10 06:49:33'),
(9, 1, 949, 'F45 @ North Sydney', '117 Old Pittwater Road Brookvale NSW 2100', '<p>Wild Women On Top transform lives by creating life changing adventures that get women walking in nature.\r\n\r\nWild Women On Top is a community of motivated, energised women who share a common passion for life changing adventures. \r\n\r\nWe create and organise many incredible adventures, both within Australia and overseas, taking more than 400 women to over 20 destinations each year. </p><p>We offer training sessions to prepare your body and mind, with expert coaches who will support and guide you towards the adventure of your dreams. We believe in cultivating moments that take your breath away. </p>', '', '0434 027 912', 'www.f45training.com.au', 'brookvale@f45training.com.au', 'Classhopper | F45 / Wild Women On Top', 'Wild Women on Top is for all women who want to lead healthy, happy lives.', 'wild women, hiking, training, cardio, aerobics', -33.76670070, 151.26214260, 1, '2015-05-10 06:57:35', '2015-05-16 10:40:33'),
(10, 1, 721, 'Latin Motion - Classes and Social Dancing', 'Cockle Bay Wharf, 201 Sussex Street, Sydney NSW 2000', 'Latin Motion is not just another Latin dance school; we are a community connected by a passion for dance. We live and breathe dance and have heaps of fun together, day in day out.\r\n\r\nWe want to inspire the dancer that lives in everyone by nurturing creativity, self-esteem and self-confidence. We do that by providing every student with a solid foundation for dance and helping them to discover their passion and strengths.\r\n\r\nWith over 20 years of dance teaching experience, we are dedicated to developing talent at both the recreational and professional levels, through our public classes and our Academy program.\r\n\r\nOur public classes range from absolute beginners to the most advanced level. All our instructors are hand picked & trained by Oliver Pineda, 8 x World Salsa Champion, on the most effective method of teaching, getting our students to dance like they never thought they would!', '', '', '', '', '', '', '', -33.87180521, 151.20217323, 1, '2015-05-10 07:06:48', '2015-05-10 07:06:48'),
(11, 1, 766, 'YogaTime', '290 Bondi Road, Bondi NSW 2026', 'The beautifully and simply renovated space has a warm, fresh feel to it giving students the opportunity to experience the sweetness of yoga uninterrupted.\r\n\r\nYogatime started out as one class a week in Saschas family home back in 2009. It rapidly grew to three classes a week, as her classes proved very popular and were in high demand with friends and family  the word was quickly spreading! It wasnt long before a natural progression to the current studio space on Bondi Rd was necessary in 2011.\r\n\r\nThe beautifully and simply renovated space has a warm, fresh feel to it giving students the opportunity to experience the sweetness of yoga uninterrupted. The yoga studio setting encourages a calm, focused energy with the far wall entirely in its original sandstone and the glass doors looking out onto a peaceful private garden.\r\n\r\nYogatime is conveniently located on Bondi Rd amongst many trendy cafes, ideal for that after yoga cuppa. Being the only yoga studio in South Bondi, we tend to draw a lot of local near-by residents. For others a little further away, its easy to get to on the 333 or 380 bus and there are two-hour free street parking on most streets around the studio.', '', '', '', '', '', '', '', -33.89414357, 151.26813412, 1, '2015-05-10 07:09:32', '2015-05-10 07:09:32'),
(13, 1, 721, 'Body Basic PT', '1 Martin Place Sydney NSW 2000', 'Diana Dent, Body Basics Coach and Athlete\r\n\r\nI founded Body Basics in 1997, experience has helped me understand the importance of health and fitness and the immense improvement and joy it can bring to everyones life.\r\n\r\nRecently, I won two Gold Medals for Australia and coached the national Australian Junior Dragon Boat Team to winning 6 Gold, 2 Silver and 3 Bronze medals at the 2013 World Championships, Szeged, Hungary.\r\n\r\nAlthough I have experienced great individual success, I thrive in team & coaching environments. As a paddling coach, my club, state and national teams have won more podium places than any other.\r\n\r\nAs a mother of three teenage girls I have always been acutely aware of the responsibility of acting as a role model in all parts of my lifestyle, including managing a business, maintaining good health & supporting other people as a coach & mentor.\r\n\r\nOne of my greatest strengths is in helping time poor professionals identify a way to incorporate training into their busy day, while keeping them motivated as they see constant results.', '', '', '', '', '', '', '', -33.86772525, 151.20735526, 1, '2015-05-10 07:26:12', '2015-05-10 07:26:12'),
(14, 1, 829, 'Yoga To Go', '106-108 Crystal St Petersham NSW 2049', 'Yoga To Go Studio is dedicated to the pursuit of balance and transformation for both the individual and the greater community. The studio has become a space for teachers and students to come together in educating, nurturing and creating a community in which change can unfold.\r\n\r\nAs Yoga To Go Studio teachers, we are deeply committed to the practice of Yoga or Pilates and are trained to the highest standards. We pursue daily personal practice and seek ongoing professional development and training as in keeping with the traditional Iyengar Yoga lineage and the teachings of Joseph Pilates.\r\n\r\nTeachers are at ease working with individuals, groups, or individual needs within groups. We are adept and willing to work with injuries and other special needs.', '', '', '', '', '', '', '', -33.89243367, 151.14612579, 1, '2015-05-10 07:27:47', '2015-05-10 07:27:47'),
(15, 1, 632, 'Boxing Club', 'Sam Cracknell Pavillion, Anzac Pde, Kensington', 'The boxing equipment we suggest in order to start training is (Muay Thai requires the same equipment as boxing and the club will provide shinpads etc):\r\n\r\n- 1 pair of handwraps (At least 180 inches).\r\n- 1 pair of bag gloves (Super bag gloves are preferred over thumbless bag gloves which offer less protection. Bag gloves should be 10oz to 16oz)\r\n- 1 skipping rope.\r\n\r\nLater on as you progress with boxing and wish to spar you will need:\r\n- 1 pair of training/sparring gloves (at least 16oz)\r\n- Protective headgear\r\n- No-foul/groin protector\r\n- Mouthguard\r\n\r\nThe UNSW Boxing Club provides some basic equipment for its members to use but acquiring your own equipment will be most convenient for you and best for hygiene reasons as well.\r\n\r\nThe Club offers a range of gear including: gloves, handwraps, and shin pads for sale. If youre interested in buying some, just speak to a trainer at our next session.', '', '', '', '', '', '', '', -33.91758010, 151.22766495, 1, '2015-05-10 07:34:08', '2015-05-16 11:50:18'),
(16, 2, 6003, 'Benny''s Boxing @ Kick PT', 'Level 1, 2 Chapel St, East St Kilda, VIC 3182', 'Bennys Boxing is Melbournes premier personal training company, which specializes in boxing and kickboxing training. They will tailor a session to suit any fitness level. With over a decade of experience in personal training, they are well equipped and qualified to meet your fitness, health and lifestyle goals! At Bennys Boxing, youll feel supported and encouraged on your way to better health and fitness. The sessions are designed to be fun and educational so you leave feeling empowered and inspired.', '<font color="#000000" face="Times New Roman" size="3">\r\n </font><font color="#000000" face="Times New Roman" size="3">\r\n </font><font color="#000000" face="Times New Roman" size="3">\r\n\r\n  </font><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><strong>Boxing &amp; Kickboxing: </strong>These classes are a combination of boxing and kickboxing, with a focus on high cardio fitness as well as one-on-one technique<br>', '03 9078 4948', 'http://bennysboxing.com.au/', 'bennysinclair@hotmail.com', 'Classhopper | Benny''s Boxing at Kick PT St Kilda', 'Benny''s Boxing and Kickboxing classes are run weekly by Benny Sinclair at Kick PT on Chapel Street in St Kilda', 'boxing, kickboxing, chapel, st kilda, kick, pt, casual, melbourne, personal training', -37.85850800, 144.99271500, 1, '2015-05-12 12:32:50', '2015-05-18 09:55:28'),
(17, 2, 6000, 'Benny''s Boxing @ Terry Bennett''s', '227-229 High Street, Prahran VIC 3181', 'Bennys Boxing is Melbournes premier personal training company, which specializes in boxing and kickboxing training. They will tailor a session to suit any fitness level. With over a decade of experience in personal training, they are well equipped and qualified to meet your fitness, health and lifestyle goals! At Bennys Boxing, youll feel supported and encouraged on your way to better health and fitness. The sessions are designed to be fun and educational so you leave feeling empowered and inspired.', '<strong>Boxing</strong>: <table width="689" style="width: 517pt; border-collapse: collapse;" border="0" cellspacing="0" cellpadding="0"><font color="#000000" face="Times New Roman" size="3">\r\n </font><colgroup><col width="689" style="width: 517pt; mso-width-source: userset; mso-width-alt: 25197;"><font color="#000000" face="Times New Roman" size="3">\r\n </font><tbody><tr height="20" style="height: 15pt;"><font color="#000000" face="Times New Roman" size="3">\r\n\r\n  </font><td width="689" height="20" style="border: 0px windowtext; width: 517pt; height: 15pt; background-color: transparent;"><font color="#000000" face="Calibri" size="3">These\r\n  boxing classes cater for all levels, with a focus on high cardio fitness as\r\n  well as one-on-one technique</font></td><font color="#000000" face="Times New Roman" size="3">\r\n\r\n </font></tr><font color="#000000" face="Times New Roman" size="3">\r\n</font></tbody></table><br>', '03 9078 4948', 'http://bennysboxing.com.au/', 'bennysinclair@hotmail.com', 'Classhopper | Benny''s Boxing at Terry Bennett''s Gym Prahran', 'Terry Bennett''s Gym in Prahran is home to Benny''s Boxing classes, run by Benny Sinclair', 'boxing, gym, terry bennett, prahran, casual, melbourne', -37.85194800, 144.99566100, 1, '2015-05-12 12:32:50', '2015-05-18 09:35:50'),
(18, 2, 5811, 'Body Transformers Fitness North Balwyn', 'Balwyn Park Scout Hall - 4 Cherry Road, Balwyn VIC 3103', 'Body Transformers Fitness offer a variety of classes for all fitness levels and ages. They specialise in boxing, kickboxing, bootcamp, HIIT, circuit training, and core conditioning. With over 30 classes per week, you can mix it up so you never get bored! All classes are designed for both men and women. Don''t worry if you feel like you can''t keep up, the trainers will modify exercises to make them easier or harder to suit your needs.', '<font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 8pt;"><font face="Calibri"><font size="3"><font color="#000000"><strong>Boxing:</strong> <span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>This class\r\nmainly involves boxing combinations, cardio drills, and specific boxing\r\nexercises. This class is designed for beginner to advanced levels of fitness.\r\nWorkout includes using upper and lower body and is great for anyone wanting to\r\nincrease their cardiovascular fitness and lose those unwanted kilos.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 8pt;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3"><strong>SmasHIIT</strong>: This class uses bootcamp style equipment\r\nsuch as; Battle Ropes, Kettlebells, Weighted Vests, Slam Balls, TRX, Barbells\r\nand much more, this is a full body killer. This class is designed to help you\r\nbuild stronger muscles faster, develop better endurance, and accelerate your\r\nfitness goals.</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">Power Circuit: A well-structured workout as you\r\nmove through a series of stations. Stations will vary and may include body\r\nweight exercises, weights, resistance bands, medicine balls, steps, spin bikes,\r\nand much more!</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3"><strong>COREflex:</strong> Designed to improve your balance,\r\nstrength, stability, flexibility, posture, abdominal fitness as well as\r\npreventing injury and reducing lower back pain. This is a concrete way to\r\nimprove your balance and athletic performance.</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3"><strong>Kettlebells:</strong> Training with Kettlebells will give\r\nfast results for strength, endurance and muscle toning by working both the\r\nmuscular and cardiovascular systems with dynamic, total body movements.</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3"><strong>Tight &amp; Toned:</strong> A unique variety of body-weight\r\nexercises combined with the use of light dumbbell weights that will tighten and\r\ntone your body from head to toe.</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3"><strong>THT:</strong> "Tummy, Hips &amp; Thighs" - This\r\nclass offers a huge variety of lower body exercises, using equipment and your\r\nown bodyweight to help shape your hips and thighs all while learning to\r\nproperly engage your core to increase your overall fitness</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3"><strong>Cardio Blast:</strong> Achieve the ultimate high-energy, fat\r\nburning workout with this go-go-go session. Run, Skip, Step, Jump!</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3"><strong>Insane Bolt:</strong> This class involves sprinting drills</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3"><strong>Crew 55:</strong> A low impact class designed to increase\r\nmuscular endurance, strength, flexibility and fitness for 55+ years young</font></span><br></p>', '0437 887 637', 'http://www.bodytransformersfitness.com.au/', 'amandaturnerpt@gmail.com', 'Classhopper | Body Transformers Fitness in Balwyn', 'Body Transformers Fitness in Balwyn specialise in outdoor bootcamp, circuit training, HIIT, core conditioning, boxing and kickboxing sessions', 'body, fitness, balwyn, outdoor, bootcamp, circuit training, HIIT, core, conditioning, boxing, kickboxing, casual, melbourne', -37.81392900, 145.07859800, 1, '2015-05-12 12:32:50', '2015-05-18 10:11:24'),
(19, 2, 6009, 'Bridge Fitness Elwood', 'Meeting Point: Sailing Club at Elwood Foreshore, Ormond Esplanade, Elwood VIC 3184', 'Bridge Fitness is a comfortable, motivating all-female friendly outdoor training group. The focus is on empowering women, boosting their confidence and creating an active community which helps everyone achieve their goals. Bridge Fitness are less about commando and more about inspiration.', '<font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 8pt;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;">Strength/Toning:</b> <span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Our Body Toning sessions are a combination of weight\r\ntraining, resistance bands and body weight exercises. Using an abundance of\r\ntechniques, these toning&nbsp; and strength sessions will help support and\r\nsculpt your entire body and improve your posture.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;">Cardio/Core:</b> <span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>This combines high intense bursts of cardio\r\nincluding sprints and plyometric exercise with minimal rest periods, pushing\r\nthe heart rate up and down. This style of training not only improves your\r\ncardiovascular health, but burns maximum calories helping to improve your\r\nmetabolism. Cardio sessions aim to increase VO2 max, decrease body fat, reduce\r\nblood pressure and improve overall general well-being.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Boxing/Battleropes:</span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''> Boxing sessions are high intensity and incorporate\r\nboth strength and cardio components. Boxing is a great way to get rid of\r\nunwanted stress and helps cardiovascular endurance enormously. It is an\r\nall-round workout that also builds core strength and balance, by using all\r\nmuscle groups. Boxing classes are catered to all fitness levels.</span></font></font></font><br></p>', '0424 198 518', 'http://bridgefitness.com.au/', 'info@bridgefitness.com.au', 'Classhopper | Bridge Fitness Bootcamps Elwood', 'Bridge Fitness run weekly ''Women Only'' outdoor bootcamp training in Elwood. These fitness sessions focus on cardio, core, strength and toning', 'fitness, women only, outdoor, bootcamp, training, elwood, cardio, core, strength, toning, casual, melbourne', -37.88705100, 144.98388430, 1, '2015-05-12 12:32:50', '2015-05-18 10:17:27'),
(20, 2, 5907, 'Bridge Fitness South Yarra', 'Meeting Point: Car park at the top of the hill at the end of Como Avenue, Como Park, Como Avenue, South Yarra VIC 3141', 'Bridge Fitness is a comfortable, motivating all-female friendly outdoor training group. The focus is on empowering women, boosting their confidence and creating an active community which helps everyone achieve their goals. Bridge Fitness are less about commando and more about inspiration.\r\nMeeting Point: Car park at the top of the hill at the end of Como Avenue, Como Park, Como Avenue, South Yarra', '<font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 8pt;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;">Strength/Toning:</b> <span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Our Body Toning sessions are a combination of weight\r\ntraining, resistance bands and body weight exercises. Using an abundance of\r\ntechniques, these toning&nbsp; and strength sessions will help support and\r\nsculpt your entire body and improve your posture.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;">Cardio/Core:</b> <span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>This combines high intense bursts of cardio\r\nincluding sprints and plyometric exercise with minimal rest periods, pushing\r\nthe heart rate up and down. This style of training not only improves your\r\ncardiovascular health, but burns maximum calories helping to improve your\r\nmetabolism. Cardio sessions aim to increase VO2 max, decrease body fat, reduce\r\nblood pressure and improve overall general well-being.</span></font></font></font><br></p>', '0424 198 518', 'http://bridgefitness.com.au/', 'info@bridgefitness.com.au', 'Classhopper | Bridge Fitness Bootcamps South Yarra', 'Bridge Fitness offer ''Women Only'' outdoor group training sessions at Cantini Gardens in St Kilda. Bootcamps focus on cardio, core, strength and toning', 'fitness, women only, outdoor, group training, Cantini gardens, st kilda, bootcamp, core, cardio, strength, toning, casual, melbourne', -37.83800350, 145.00273320, 1, '2015-05-12 12:32:50', '2015-05-18 10:18:44'),
(21, 2, 6003, 'Bridge Fitness St Kilda', 'Meeting Point: Car park on Pier Road, behind the rotunda in the garden, Cantini Gardens, Pier Road, St Kilda VIC 3182', 'Bridge Fitness is a comfortable, motivating all-female friendly outdoor training group. The focus is on empowering women, boosting their confidence and creating an active community which helps everyone achieve their goals. Bridge Fitness are less about commando and more about inspiration.', '<font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 8pt;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;">Strength/Toning:</b> <span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Our Body Toning sessions are a combination of weight\r\ntraining, resistance bands and body weight exercises. Using an abundance of\r\ntechniques, these toning&nbsp; and strength sessions will help support and\r\nsculpt your entire body and improve your posture.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;">Cardio/Core:</b> <span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>This combines high intense bursts of cardio\r\nincluding sprints and plyometric exercise with minimal rest periods, pushing\r\nthe heart rate up and down. This style of training not only improves your\r\ncardiovascular health, but burns maximum calories helping to improve your\r\nmetabolism. Cardio sessions aim to increase VO2 max, decrease body fat, reduce\r\nblood pressure and improve overall general well-being.</span></font></font></font><br></p>', '0424 198 518', 'http://bridgefitness.com.au/', 'info@bridgefitness.com.au', 'Classhopper | Bridge Fitness Bootcamps St Kilda', 'Bridge Fitness ''Women Only'' outdoor bootcamp group training sessions at Como Park in South Yarra focus on strength, toning, core and cardio workouts', 'fitness, women only, outdoor, bootcamp, group training, como park, south yarra, strength, toning, core, cardio, workout, casual, melbourne', -37.86381820, 144.97106720, 1, '2015-05-12 12:32:50', '2015-05-18 10:22:52');
INSERT INTO `studios` (`id`, `city_id`, `suburb_id`, `title`, `address`, `description`, `classes_description`, `phone`, `website`, `email`, `meta_title`, `meta_description`, `meta_keywords`, `lat`, `lng`, `visible`, `created`, `modified`) VALUES
(22, 2, 6002, 'Brophy''s Body & Mind', '1-7 McIlwrick Street, Windsor VIC 3181', '<p>Brophys Body &amp; Mind has been established for over 30 years and combine Western technology with an Eastern philosophy so that you can true harmony between the body and mind. </p><p>Brophys Body &amp; Mind will make you feel right at home by utilizing the oldest health care system in the world  Ayurveda. </p><p>Ayurveda is the sister science of Yoga, and translates to the science of long life. Brophys group classes offer something for everyone. The qualified instructors design each class to suit all fitness levels, body types and ages, whilst providing an individualized and personalized approach.</p>', '<font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;">Pilates Props:</b> <span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;">Improve your stability, flexibility &amp; strength\r\nwith precise, core-centred (Pilates) movements. Suits all body types,\r\nespecially Kapha. Includes use of fitball, chi balls and resistance bands.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;">Sculpt:</span></b><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"> Tone and strengthen your entire body using light\r\nweights and an adjustable barbell. Simple moves to suit all.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;">ABS Blitz:</span></b><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"> 30 minutes of core conditioning. Go beyond the\r\nbasic crunch to sculpt and tone your midsection</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;">Tabata:</span></b><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"> High Intensity Training (HIIT) at its best! The\r\nTabata protocol involves performing exercises at high intensity for 20 sec\r\nfollowed by 10 sec rest. Repeated 8 times for a total training time of 4 mins\r\nper set. Try this 30 min class &amp; feel your overall fitness improve.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;">Circuit:</span></b><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"> This class is an all-in-one workout. Work your\r\nentire body at cardio &amp; conditioning stations. Reach your goals faster with\r\ngroup training the Group Fitness way.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;">Pilates:</span></b><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"> A method of body strengthening from the inside\r\nout. Use precise movements to improve your posture, flexibility, concentration\r\n&amp; core strength. Ideal for all body types</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;">Pilates/Yoga:</span></b><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"> A class which blends both mind/body disciplines to\r\ndevelop strength, flexibility, and concentration. Add variety to your mat\r\npractice with the mindful movements practised in this hour. Suits all body\r\ntypes.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;">Yin Yoga:</span></b><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"> A patient practise, targeting the connective\r\ntissues of the hips, pelvis &amp; lower spine. Containing mostly floor-work,\r\nYin postures are held for longer than in most Yoga styles.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;">Hatha Yoga:</span></b><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"> Breathe, Extend, Meditate. Work on flexibility,\r\nstress release &amp; relaxation</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;">Iyengar\r\nYoga:</span></b><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"> Breathe, Align, Meditate. Focus on correcting\r\nposture and creating stillness of the mind.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;">Vinyasa\r\nYoga:</span></b><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: &quot;Times New Roman&quot;; mso-fareast-language: EN-AU;"> Vinyasa, meaning breath-synchronised movement,\r\nconnects Hatha yoga asanas (postures) through movement and breath. The asanas\r\ncan be arranged into different sequences that can meet the practitioners needs\r\nor mood.</span></font></font></font><br></p>', '03 9529 6161', 'http://brophysbodyandmind.com.au/', 'info@brophysbodyandmind.com.au', 'Classhopper | Brophy''s Body & Mind Windsor', 'Brophy''s Body & Mind in Windor is a boutique gym  and yoga studio which runs weekly yoga, pilates, circuit and core conditioning group fitness classes', 'body, boutique gym, gym, yoga, yoga studio, pilates, circuit, core conditioning, group fitness, fitness classes, casual, melbourne', -37.85545600, 144.99339400, 1, '2015-05-12 12:32:50', '2015-05-20 12:59:11'),
(23, 2, 6069, 'Carol Liknaitzky Classic Nia', '45 Ferrars Place, Albert Park VIC 3206', 'Nia helps us celebrate life, appreciate the wisdom of our bodies and find harmony and integration. Nia also enables us to express our powerful uniqueness, create new neural pathways and slow down the ageing process. Nia will get you in touch with yourself and activate your potential to be healthy, strong and agile. Confidence is rooted in the body, expressed in our feelings and brings clarity to our thoughts.Wear comfortable clothes!', '<strong>Nia: </strong>Nia is a joyful fitness and awareness practice that leaves you feeling uplifted and alive. discover how Nia''s unique blend of dance, martial arts and healing arts can positively change the way you look, think and feel. <br>', '03 9023 3582', 'http://www.niaaustralia.com.au/component/jomdirectory/100-Carol-Liknaitzky', 'cliknaitzky@gmail.com', 'Classhopper | Nia with Carol in Albert Park', 'Carol Liknaitzky runs classic Nia classes in Albert Park. Nia is a unique blend of dance, martial arts and healing designed to improve fitness and awareness', 'Carol, nia, albert park, dance, martial arts, healing, fitness, casual, melbourne', -37.84097720, 144.95887210, 1, '2015-05-12 12:32:50', '2015-05-18 10:47:09'),
(25, 2, 5907, 'Elevator Dance Studios', 'Level 1, 2-4 River Street, South Yarra VIC 3141', 'Elevator Dance Studios offer a variety of adult dance classes and styles. Brush up on your dance skills whilst getting a great workout. Classes are available for different skill levels so theres a class to suit everyone! ', '<br>', '03 9077 5459', 'http://www.elevatorstudios.com.au', 'info@elevatorstudios.com.au', 'Classhopper | Elevator Dance Studio South Yarra', 'Elevator Dance Studio in South Yarra specialise in a variety of dance classes such as jazz, ballet, samba, stretch and strength, and tap. Brush up on your dance skills whilst getting a great workout', 'elevator, dance, dance studio, south yarra, dance classes, dance skills, casual dance classes, jazz, ballet, samba, stretch and strength, tap dancing, casual, melbourne', -37.83919800, 144.99769800, 1, '2015-05-12 12:32:50', '2015-05-16 23:13:32'),
(26, 2, 6006, 'FitMiss Health Club', '232 Carlisle Street, Balaclava VIC 3183', 'FitMiss Health Club specialises in fitness for women, by women. Whether you want to lose weight, improve fitness, increase strength or tone up, the qualified trainers are there to support you and help you achieve your health and fitness goals. All equipment is provided so just bring water and a towel!', '<font color="#000000" face="Times New Roman" size="3"><strong>\r\n\r\n</strong></font><font face="Calibri"><font size="3"><font color="#000000"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font face="Calibri"><p style="margin: 0cm 0cm 0pt; line-height: normal;"></p><font size="3"><p style="margin: 0cm 0cm 0pt; line-height: normal;"></p><font color="#000000"><p style="margin: 0cm 0cm 0pt; line-height: normal;"></p><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><p style="margin: 0cm 0cm 0pt; line-height: normal;"><strong>Pilates - Women Only: </strong>This class offers a total body workout with added strength benefits incorporating pilates rings, rollers and resistance bands.&nbsp;</p><p class="font_8">This class is suitable for beginners who would like to give pilates a try or for the more experienced.&nbsp;&nbsp;</p></span><p class="font_8"></p><p style="margin: 0cm 0cm 0pt; line-height: normal;"></p></font><p style="margin: 0cm 0cm 0pt; line-height: normal;"></p></font><p style="margin: 0cm 0cm 0pt; line-height: normal;"></p></font><p style="margin: 0cm 0cm 0pt; line-height: normal;"></p></span><p style="margin: 0cm 0cm 0pt; line-height: normal;"><strong><br></strong></p></span><p style="margin: 0cm 0cm 0pt; line-height: normal;"></p></font><p style="margin: 0cm 0cm 0pt; line-height: normal;"></p></font><p style="margin: 0cm 0cm 0pt; line-height: normal;"></p></font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Intermediate\r\nYoga  Women Only: </span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>This class\r\nis for anyone who has done yoga in the past and has a basic understanding of\r\nyoga poses. These classes combine hatha and flow styles of yoga to strengthen\r\nand lengthen your muscles, improve flexibility and help you understand\r\nbreathing techniques, as well as a mind-body connection.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></b></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Shadow Boxer\r\n Women Only: </span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>This is a no-impact, resistance training style of\r\nboxing. It is a cardio, toning and strengthening workout choreographed to\r\nmusic. It involved 3-minute rounds that get your heart rate up and energy\r\nlevels pumping in order to burn calories and tone your body.</span></font></font></font><br></p>', '03 9525 4555', 'http://www.fitmisshealthclub.com.au/', 'team@fitmesshealthclub.com.au', 'Classhopper | FitMiss Health Club Balaclava', 'FitMiss Health Club on Carlisle Street in Balaclava is a ''Women Only'' gym which offers group fitness classes such as intermediate hatha yoga and shadow boxing to women of all ages and fitness levels', 'fitmiss, health club, carlisle, balaclava, shadow boxing, boxing, yoga, hatha yoga, intermediate yoga, group fitness, fitness classes, women only, casual, melbourne', -37.86823800, 144.99182000, 1, '2015-05-12 12:32:50', '2015-05-19 07:06:24'),
(27, 2, 6010, 'For Fit Sake', '1-2 Horne Street, Elsternwick VIC 3185', 'For Fit Sake is located in the vibrant centre of Elsternwick and has quickly established itself as one of Melbourne''s premier health and fitness providers. Set up in with a multizone converted warehouse, For Fit Sake offers tailored fitness solutions for clients of all ages and fitness levels.', '<strong>Boxing: </strong>A 60 minute full body and intensive workout routine that is designed to increase stamina, strength and cardio fitness<br>', '0421 498 649', 'http://forfitsake.net.au/', 'dave@forfitsake.net.au', 'Classhopper | For Fit Sake Elsternwick', 'For Fit Sake personal training and private gym in Elsternwick offers weekly group boxing training sessions and fitness classes', 'fit, elsternwick, gym, personal training, boxing, training, group fitness, group fitness classes, fitness classes, fitness sessions, casual, melbourne', -37.88431400, 144.99934000, 1, '2015-05-12 12:32:50', '2015-05-18 11:08:17'),
