015-05-12 12:32:50', '2015-05-18 10:41:19'),
(29, 2, 6003, 'Hoops Thighs & Buttocks @ 4DVERSE', '4DVERSE:1/118A Carlisle Street, St Kilda VIC 3182', 'Hoops, Thighs &amp; Buttocks are hottest new kid on the block, bringing you Melbournes best dose of fitness, dance, hula hooping and laughter. What have we got for you? Hula Hoop classes taught by some of Melbournes most talented hula hoopers with years of teaching experience.&nbsp; AND Booty Camp: The most unique and fun boot camp fitness workout in town!', '<font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;">Hula Hooping: </b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Experienced and talented instructors teaching you\r\nall the coolest hula hoop tricks. Covering the basics, moving the hoop up and\r\ndown your body, isolations, transitions, finding your own groove with the hoop,\r\nand fancy tricks to show off to all your friends. or that special someone\r\nwhos eye youre trying to catch. All levels welcome and we supply all the\r\nhoops or bring your own if you have one.</span></font></font></font><br></p>', '0435 236 316', 'http://hoopsthighsbuttocks.com/', 'hoopsthighsbuttocks@gmail.com', 'Classhopper | Hoops, Thighs & Buttocks at PCYC St Kilda', 'Hoops, Thighs & Buttocks Hula Hooping classes at PCYC in St Kilda are run by some of Melbourne''s best hula hoopers who ensure you have fun whilst getting fit', 'hoops, thighs, buttocks, PCYC, st kilda, hula hoop, hula hooping, hula hooper, fun, fit, fitness, casual, melbourne', -37.86782300, 144.98794400, 1, '2015-05-12 12:32:50', '2015-05-18 10:42:15'),
(30, 2, 5956, 'IDF Training', '105 Hawthorn Road, Caulfield North VIC 3161', '<p>IDF Training is known as the home of Krav Maga in Melbourne. IDF training provides over 30 classes per week from a range of different fighting styles and fitness options. </p><p>The signature class at IDF Training is Krav Maga, Israeli Martial Arts. However, IDF Training also offer Brazilian Jiu Jitsu (BJJ), boxing, kickboxing, mixed martial arts (MMA) and FMA classes. </p><p>The studio also provides a full weights gym, shower facilities and exceptional training and customer service.</p>', '<font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Beginner\r\nKrav Maga: </span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Krav Maga&nbsp;is the official close quarters\r\ncombat system of the Israel Defence Forces. Its a reality-based self defence\r\nsystem used by many elite combat, defence, and law enforcement units all around\r\nthe world. This class is for anyone wanting to try Krav Maga.&nbsp;Start here,\r\nthen work your way up into the intermediate class.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Brazilian\r\nJiu-Jitsu: </span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>BJJ&nbsp;is a grappling art adapted from judo. It\r\neffectively teaches smaller people to overpower those who are larger and\r\nstronger. All levels welcome, including absolute beginners!</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></b></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Boxing: </span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Boxing classes focus on teaching you the proper\r\nstriking, blocks, footwork and breathing and are perfect whether you just want\r\nto have a great workout or to get in the ring.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></b></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Intermediate\r\nKrav Maga: </span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Krav Maga&nbsp;is the official close quarters\r\ncombat system of the Israel Defence Forces. Its a reality-based self defence\r\nsystem used by many elite combat, defence, and law enforcement units all around\r\nthe world. This class is for students who have taken the Krav Maga Level 1 test\r\nand passed. You will need a mouth guard, groin guard (for men), shin guards and\r\nMMA gloves. All equipment is available for purchase at the gym.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></b></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Fit to\r\nFight: </span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>This class is a fitness conditioning class\r\nincorporating martial arts techniques.&nbsp;There is no physical contact in\r\nthis class, and its emphasis is on fitness. All fitness levels welcome,\r\nincluding absolute beginners!</span></font></font></font><br></p>', '1300 858 265', 'http://www.idftraining.com.au/', 'accounts@idftraining.com.au', 'Classhopper | IDF Training Krav Maga Training Caulfield North', 'IDF Training in Caulfield North is a specialised Krav Maga, Martial Arts, Self Defence and Boxing gym which offers group training sessions, run by highly skilled instructors', 'IDF, training, caulfield, caulfield north, krav maga, martial arts, boxing, self defence, group training, group training sessions, casual, melbourne', -37.87280690, 145.02466700, 1, '2015-05-12 12:32:50', '2015-05-18 10:33:02'),
(31, 2, 6019, 'Ihana Yoga Hampton', '1/562 Hampton Street, Hampton VIC 3188', 'Ihana Yoga are committed to providing high-quality yoga classes, based on anatomical and physiological understanding. Students will learn healthy movement patterns and safe alignment techniques, whilst being inspired, motivated and empowered. Ihana Yogas mission is to raise consciousness through the core philosophy of yoga: union or oneness with all of life. Ihana Yoga is proud to be the first eco-friendly yoga studio in Victoria. Each month, Ihana Yoga studio donates part of its profits to UNHCR and ACF. The St Kilda studio is a large studio which fits 70 yoga mats. BYO mat or rent for $1', '<strong>Vinyasa Flow: </strong>These classes offer an element of surprise, as each session is sequenced differently. Suitable for all levels, as different variations of each pose will be instructed. The studio plays background music in all of their Vinyasa Flow classes. BYO mat or rent one for $1<br>', '03 9598 9994', 'http://www.ihanayoga.com.au', 'info@ihanayoga.com.au', 'Classhopper | Ihana Yoga Hampton', 'Ihana Yoga Studio on Hampton Street, specialise in Vinyasa Flow Yoga designed for people of all ages and fitness levels from beginners to experienced yogis', 'ihana, yoga, vinyasa, vinyasa flow, hampton, hampton street, casual, melbourne, yogi, yogis, beginner yoga', -37.93210600, 145.00401700, 1, '2015-05-12 12:32:50', '2015-05-18 10:35:42'),
(32, 2, 6003, 'Ihana Yoga St Kilda', '1/82 Acland Street, St Kilda VIC 3182', 'Ihana Yoga are committed to providing high-quality yoga classes, based on anatomical and physiological understanding. Students will learn healthy movement patterns and safe alignment techniques, whilst being inspired, motivated and empowered. Ihana Yogas mission is to raise consciousness through the core philosophy of yoga: union or oneness with all of life. Ihana Yoga is proud to be the first eco-friendly yoga studio in Victoria. Each month, Ihana Yoga studio donates part of its profits to UNHCR and ACF. The St Kilda studio is a large studio which fits 70 yoga mats. BYO mat or rent for $1.', '<strong>Vinyasa Flow: </strong>These classes offer an element of surprise, as each session is sequenced differently. Suitable for all levels, as different variations of each pose will be instructed. The studio plays background music in all of their Vinyasa Flow classes. BYO mat or rent one for $1<br>', '0405 687 303', 'http://www.ihanayoga.com.au', 'info@ihanayoga.com.au', 'Classhopper | Ihana Yoga St Kilda', 'Ihana Yoga Studio in St Kilda specialises in Vinyasa Flow Yoga at their beautiful studio located close to Acland Street and St Kilda Beach', 'ihana, yoga, vinyasa, vinyasa flow, st kilda, beach, acland, st kilda beach, acland street, casual, melbourne', -37.86722250, 144.97882000, 1, '2015-05-12 12:32:50', '2015-05-18 10:34:44'),
(33, 2, 6019, 'Inner Fox Fitness', '74 Highett Road, Hampton VIC 3188', 'Group training at Inner Fox is cardio exercise with a difference. They call it, "I.C.E.", or Intense Cardio Exercise. Sessions are short and sharp. If you want to get fit, change how you look, or if you want to lose fat, then welcome to Inner Fox Fitness I.C.E.! ', '<strong>Intense Cardio Exercise (I.C.E.): </strong>These cardio sessions are 25 minutes long and maximise fat loss by ensuring cardio training is efficient. These classes are suitable for all fitness levels and each session is fun and different from the last! You''ll be surrounded by motivating and supportive instructors and you can even bring you kids!<br>', '0416 696 405', 'http://www.innerfoxfitness.com.au/', 'philip@innerfoxfitness.com.au', 'Classhopper | Inner Fox Fitness Hampton', 'Inner Fox Fitness in Hampton run intense cardio exercise (ICE) group fitness sessions which promote metobolic conditioning, strength training, and weightloss', 'fitness, hampton, cardio, exercise, group fitness, group fitness sessions, fitness sessions, metobolic conditioning, strength, strength training, weightloss, weight loss, casual, melbourne', -37.94579280, 145.01744510, 1, '2015-05-12 12:32:50', '2015-05-18 10:43:30'),
(34, 2, 5706, 'Love My Body Carlton', 'Carlton Gardens, 1-111 Carlton St, Carlton Victoria Australia', 'Lose weight and get fit fast with Love My Body! These Women Only bootcamps offer the perfect combination of cardiovascular and resistance training to tone and shape your body and lose body fat. All ages and fitness levels are welcome.\r\n', '<strong>Love my Body Bootcamps: </strong>These 50 minute Women Only bootcamp sessions combine cardio, strength and resistance training to help you achieve your weight loss and fitness goals. All ages and fitness levels are welcome!<br>', '0438 886 382', 'http://www.lovemybody.com.au', 'hayley@lovemybody.com.au', 'Classhopper | Love My Body Bootcamps Carlton', 'Love My Body ''Women Only'' bootcamps at Carlton Gardens focus on cardiovascular and resistance training to tone and shape your body in a fun and friendly environment', 'body, women only, bootcamp, carlton gardens, carlton, cardio, cardiovascular, resistance training, tone and shape, casual, melbourne', -37.80315400, 144.97179600, 1, '2015-05-12 12:32:50', '2015-05-18 11:17:00'),
(35, 2, 6010, 'Love My Body Elsternwick', 'Boutique Health Club - 20A Horne Street, Melbourne/Elsternwick VIC 3185', 'Lose weight and get fit fast with Love My Body! These Women Only bootcamps offer the perfect combination of cardiovascular and resistance training to tone and shape your body and lose body fat. All ages and fitness levels are welcome.\r\n', '<strong>Love my Body Bootcamps: </strong>These 50 minute Women Only bootcamp sessions combine cardio, strength and resistance training to help you achieve your weight loss and fitness goals. All ages and fitness levels are welcome!<br>', '0438 886 382', 'http://www.lovemybody.com.au', 'hayley@lovemybody.com.au', 'Classhopper | Love My Body Bootcamps Elsternwick', 'Love My Body ''Women Only'' bootcamps at Boutique Health Club in Elsternwick combine resistance training, cardiovasular, toning and shaping exercise to help achieve your goals', 'body, women only, bootcamp, elsternwick, health club, boutique health club, resistance training, cardio, cardiovascular, shape and tone, shaping and toning, exercise, weightloss, weight loss, casual, melbourne', -37.88504200, 144.99997400, 1, '2015-05-12 12:32:51', '2015-05-20 12:57:58'),
(36, 2, 6032, 'Nia with Tiffany @ Black Rock', 'Black Rock Civic Hall, Corner of Balcombe Rd and College Gr, Black Rock VIC 3193', 'Nia is for EveryBody!   It empowers people of all ages, shapes, sizes and fitness levels to connect to their body, mind, emotions and spirit by paying attention to sensation. You do not need coordination or experience. You just need the desire to move! Tiffany is passionate about wellbeing and strongly believes in Nias philosophy Through Movement we find Health. Wear comfortable clothes!', '<strong>Nia: </strong>Nia is based on the idea that exercise should feel good inside and out. Nia is a sensory-based practice that incorporates dance, martial arts and healing arts.&nbsp; Nia promotes mindfulness, holistic fitness and wellbeing. It gives us flexibility, agility, mobility, strength and stability. It feels good and is fun to do!<br>', '0459 992 213', 'http://www.niaaustralia.com.au/component/jomdirectory/206-Tiffany-Tyler-Dignam', 'niawithtiffany@gmail.com', 'Classhopper | Nia with Tiffany in Black Rock', 'Tiffany Tyler-Dignam''s Nia classes in Black Rock promotes mindfulness, holistic fitness and wellbeing though a combination of dance and martial arts', 'tiffany, nia, black rock, fitness, wellbeing, dance, martial arts, casual, melbourne', -37.97455470, 145.01936240, 1, '2015-05-12 12:32:51', '2015-05-18 10:50:53'),
(37, 2, 6013, 'Nia with Tiffany @ Brighton', 'Arthur Murray Dance Studio, 136-138 Martin Street, Brighton VIC 3186', 'Nia is for EveryBody!   It empowers people of all ages, shapes, sizes and fitness levels to connect to their body, mind, emotions and spirit by paying attention to sensation. You do not need coordination or experience. You just need the desire to move! Tiffany is passionate about wellbeing and strongly believes in Nias philosophy Through Movement we find Health. Wear comfortable clothes!', '<strong>Nia:</strong> Nia is based on the idea that exercise should feel good inside and out. Nia is a sensory-based practice that incorporates dance, martial arts and healing arts.&nbsp; Nia promotes mindfulness, holistic fitness and wellbeing. It gives us flexibility, agility, mobility, strength and stability. It feels good and is fun to do!<br>', '0459 992 213', 'http://www.niaaustralia.com.au/component/jomdirectory/206-Tiffany-Tyler-Dignam', 'niawithtiffany@gmail.com', 'Classhopper | Nia with Tiffany in Brighton', 'Nia classes at Arthur Murray Dance Studio in Brighton are run by Tiffany Tyler-Dignam, which combine dance and martial arts to increase fitness, awareness and healing', 'tiffany, nia, brighton, arthur murray, dance, dance studio, martial arts, fitness, healing, casual, melbourne', -37.89761100, 145.00361700, 1, '2015-05-12 12:32:51', '2015-05-18 10:51:18'),
(38, 2, 5909, 'Pilates Wellness Australia', 'Shop 5/145 Canterbury Rd, Toorak VIC 3142', 'Pilates Wellness Australia not only values movement as a necessary preventative measure for lifestyle related diseases it also views it as necessary in order to provide balance between the physical and cognitive aspects of our beings. These classes improve individuals core strength, muscle strength, endurance, postural awareness, range of movement and over all general wellbeing through the use of intelligent movement. Pilates Wellness Australia also aim to reduce stress and create a sense of wellbeing for individuals through knowledge and practice. Pilates Wellness Australia offer fully tailored classes featuring both mat work, and reformer beds.', '<strong>Reformer Pilates: </strong>These 60 minute pilates classes are tailored to suit any individuals needs and utilise both mat work and reformer beds. Classes hold up to four students so you get all the attention you deserve to maximise your workout.<br>', '0404 415 692', 'http://www.pilateswellness.com.au/', 'emma@pilateswellness.com.au', 'Classhopper | Pilates Wellness Australia Toorak', 'Pilates Wellness Australia Studio in Toorak offer group mat and reformer pilates classes, designed to improve core strength, muscle strength and wellbeing ', 'pilates, wellness, australia, toorak, pilates studio, mat, reformer, reformer pilates, mat pilates, group pilates, core strength, muscle strength, wellbeing, casual, melbourne', -37.84208200, 145.01021300, 1, '2015-05-12 12:32:51', '2015-05-18 10:48:43'),
(39, 2, 5907, 'Pilates Wellness Australia Bootcamps', 'Como Park, South Yarra VIC 3141', 'Pilates Wellness Australia not only values movement as a necessary preventative measure for lifestyle related diseases it also views it as necessary in order to provide balance between the physical and cognitive aspects of our beings. These classes improve individuals core strength, muscle strength, endurance, postural awareness, range of movement and over all general wellbeing through the use of intelligent movement. Pilates Wellness Australia also aim to reduce stress and create a sense of wellbeing for individuals through knowledge and practice. Pilates Wellness Australia offer fully tailored classes featuring both mat work, and reformer beds. Meeting Point: Under Bendigo Bank sign at Como Park, South Yarra VIC 3141', '<strong>Booty Camp: </strong>These 45 minute bootcamps are run outdoors so you can enjoy the beautiful South Yarra scenery. These sessions utilise a combination of cardio, high intensity interval training (HIIT) and pilates.<br>', '0404 415 692', 'http://www.pilateswellness.com.au/', 'emma@pilateswellness.com.au', 'Classhopper | Pilates Wellness Australia Bootcamp South Yarra', 'Pilates Wellness Australia outdoor ''Women Only'' Booty Camp bootcamp group fitness classes at Como Park in South Yarra focus on cardio, high intensity interval training (HIIT) and pilates', 'pilates, wellness, australia, south yarra, outdoor, women only, booty camp, bootcamp, group fitness, fitness classes, como park, cardio, high intensity interval training, HIIT, casual, melbourne', -37.83834730, 145.00498800, 1, '2015-05-12 12:32:51', '2015-05-18 10:49:44');
INSERT INTO `studios` (`id`, `city_id`, `suburb_id`, `title`, `address`, `description`, `classes_description`, `phone`, `website`, `email`, `meta_title`, `meta_description`, `meta_keywords`, `lat`, `lng`, `visible`, `created`, `modified`) VALUES
(41, 2, 6070, 'Sweat Gym', '1 Armstrong Street, Middle Park VIC 3206', 'Sweat Gym are a boutique health and fitness club who''s core focus is helping you achieve your goals. The friendly, professional team will make you feel right at home and will work closely with you to achieve success. They provide a fun, informal approach to exercise.<br>', '<font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;">Pilates: </b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>A series of exercises which focus on rebalancing\r\nmuscle length and strength, using swiss balls, bands and weights. Pilates uses\r\nslow and controlled movements which are suitable for all fitness levels.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;">A.B.C. (Abs, Core &amp; Back): </b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>This class is designed to maintain a healthy spine,\r\npromote great posture and work your abs. This class works the entire core and\r\nabdominal muscles so prepare yourself for a focused and rewarding workout!</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Cardio\r\nAttack: </span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>This is a 45 minute major high energy workout which\r\nwill keep you buzzing all day! Get your heart pumping with this whole body\r\nworkout. This is a challenging class but has been designed with all fitness\r\nlevels in mind. The friendly staff will be constantly monitoring your\r\nperformance so anyone can participate!</span></font></font></font><br></p>', '03 9682 8998', 'http://www.sweatclub.com.au/', 'jack@sweat.com.au', 'Classhopper | Sweat Gym Middle Park', 'Sweat Gym in Middle Park offer a variety of group fitness classes including pilates, cardio, strength training and conditioning, shaping and toning to achieve all fitness goals', 'sweat, gym, middle park, cardio, pilates, core conditioning, strength training, strength conditioning, shaping and toning, shape and tone, fitness, casual, melbourne', -37.85025200, 144.96509500, 1, '2015-05-12 12:32:51', '2015-05-18 10:45:44'),
(42, 2, 5910, 'Time for Yoga', '2B Willis Street, Armadale VIC 3143', 'Time for Yoga is a studio whos core mission is to provide credible, inclusive, affordable and accessible yoga to everyone. They consider yoga to be one of the most powerful healing tools used to support the pressures of modern day lifestyles. Yoga is proven to reduce anxiety, stress, and insomnia, whilst improving energy levels, weight management, digestions, circulation, strength, flexibility and much more. Time for Yoga has taken a unique approach  the studio insists on working with a range of teachers from various disciplines such as dynamic hatha, alignment, chair yoga, restorative, Tai Chi Qi Gong and mindfulness meditation.', '<font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;">Vinyasa/Dynamic Hatha: </b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Sequences to open students to a more energising and\r\ninvigorating relationship between movement and breath, building up to safe\r\ninversions, balances and backbends. Classes aim to assist development and are\r\nboth dynamic and strong to the more nourishing and soulful.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;">Restorative Meditation: </b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>This is a very gentle, soothing practice using\r\nprops to support the body and encourage deep, nourishing releases of the whole\r\nbody. The restorative classes present a small number of postures  passive\r\nsupine, seated and prone postures  held with minimal effort for longer periods\r\nof time  between 5-10 minutes each  being ideal for students seeking to\r\nquieten down, nurse injury or achieve deep physical and emotional releases\r\nthrough their yoga.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Qi Gong/Nia:</span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''> Qi Gong is one of the Taoist yoga practices,\r\ncoming through the martial arts language of China. It is a gentle way to\r\nconnect to breath, movement, finding stillness and revitalisation within. Nia\r\nis A creative, explorative and joy-based movement practice that leaves one\r\nfeeling energised and alive.<span style="mso-spacerun: yes;">&nbsp; </span>Moving\r\nbarefoot to a soul-stirring mix of music, combining tai chi, yoga and dance,\r\nNia guides and inspires us to live and move sustainably in our body. Suitable\r\nfor all body types, ages and abilities, students gain better body awareness,\r\nconnectedness, and tune into their own healing power.</span></font></font></font><br></p>', '03 9509 1771', 'http://www.timeforyoga.com.au/', 'yoga@timeforyoga.com.au', 'Classhopper | Time For Yoga Armadale', 'Time For Yoga Studio in Armadale specialise in restorative, Vinyasa Flow and Dynamic Hatha styles of Yoga, as well as Nia and Qi Gong', 'yoga, armadale, restorative yoga, hatha, dynamic hatha, vinyasa, vinyasa flow, nia, qi gong, casual, melbourne', -37.85741100, 145.02873600, 1, '2015-05-12 12:32:51', '2015-05-18 10:39:37'),
(43, 2, 6069, 'Y Rowing Centre', '34 Lakeside Drive, Albert Park Lake VIC 3206', 'The Y Rowing Centre provides an opportunity for people of all ages to learn and enjoy rowing in a safe and friendly atmosphere. You don''t need to be exceptionally strong, or fit, to learn to row. Crew rowing is an impact-free sport that gives you a complete exercise package. The smooth and rhythmic motion of rowing provides full body exercise, aerobic and strength conditioning and helps with weight-loss. What to wear: thick pair of socks, t-shirt, bike shorts or track pants and a warm top during the winter. Y Rowing will provide the rest!', '<p><strong>Crew Rowing: </strong>This class is for people who have had some rowing experience. You don''t need your own crew because you''ll meet other new rowers and learn to work as a team, improving your rowing skills and gaining more confidence and enjoyment with each session.<br></p>', '03 9529 8596', 'www.ozonline.com.au/ywca-rowing', 'yrowing@hotmail.com', 'Classhopper | Y Rowing Centre Albert Park', 'Y Rowing Centre at Albert Park Lake run beginner and intermediate crew rowing classes for people of all ages and fitness levels', 'rowing, crew rowing, albert park, albert park lake, beginner rowing, intermediate rowing, rowing classes, casual, melbourne', -37.84428140, 144.96875570, 1, '2015-05-12 12:32:51', '2015-05-18 11:10:02'),
(44, 2, 5907, 'Yoga Dance Moves', '3/316-320 Toorak Road, South Yarra VIC 3141', 'Yoga Dance Moves is located in the heart of South Yarra and offers a variety of dance, yoga and martial arts classes for beginners to advanced. There is something for everyone at this studio. The instructors come from different backgrounds and schools of practice so every class is different. This studio encourages students to explore and develop their own sense of joy, which comes from body movement. ', '<font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>SomaChi\r\nYoga: </span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>This is a fluid style of yoga, blending Tai Chi\r\nmoves and traditional vinyasa transitions</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></b></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Dynamic\r\nVinyasa: </span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>This is a strong and dynamic yoga class, designed\r\nfor students to experience a creative combination of basic poses, including arm\r\nbalances and inversions.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Slow Flow: </span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>A gentle vinyasa yoga class, which includes SomaChi\r\nYoga and Calligraphy Yoga moves. No chaturangas, arm balances or inversions.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>General\r\nVinyasa: </span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>This class focuses on the proper alignment of basic\r\nyoga poses and vinyasa transitions; including an introduction to inversions and\r\narm balances.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></b></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Ashtanga\r\nLed: </span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>This class is centred around a series of\r\ntraditional postures with flowing movement and breathing exercises</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></b></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Yoga\r\nExpress: </span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>This is a 45 minute lunch-time class, excellent for\r\noffice lunch breaks</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></b></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Acro Yoga\r\nJam: </span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>This is a meeting place for those interested in\r\npracticing and learning acro yoga (acrobatic yoga). Come and play!</span></font></font></font><br></p>', '03 8060 2178', 'http://www.yogadancemoves.com.au/', 'info@yogadancemoves.com.au', 'Classhopper | Yoga Dance Moves South Yarra', 'Yoga Dance Moves Studio in South Yarra specialise in several types of yoga including SomaChi, Dynamic Vinyasa, Slow Flow, General Vinyasa, Ashtanga Led Yoga, and AcroYoga', 'yoga, dance, south yarra, studio, yoga studio, dance studio, somachi, vinyasa, dynamic vinyasa, flow, slow flow, ashtanga, acroyoga, acro yoga, acruyoga, acru yoga, melbourne, casual', -37.84012900, 144.99823500, 1, '2015-05-12 12:32:51', '2015-05-18 10:55:02'),
(45, 2, 6003, 'Zumba United Argyle Street', '67 Argyle St, St Kilda VIC 3182', 'Zumba United offer Zumba classes at a variety of indoor and outdoor locations around Melbourne. Zumba is a Latin inspired fitness class which incorporates Latin and international music and dance moves. It is a dynamic, effective and exciting fitness system, which combines fast and slow rhythms to sculpt and tone the body. Zumba classes operate by category and include aerobic, interval, kickboxing, pump, cardio, spin, Pilates and yoga influences to deliver a full body workout. Zumba allows you to dance your worries away whilst getting fit and active. It improves self-confidence, self-esteem and self-image. Zumba United provide classes for everyone, regardless of age, fitness or experience level. Wear comfortable clothes!', '<font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Zumba\r\nFitness: </span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>These classes are 50 minutes of crazy fun and you\r\nwont even realise youre working out  hard! With professional instructors who\r\ncreate an incredible party feel, you receive a professional fitness focussed\r\nwork out where the time will fly by. Stay consistent and you will notice the\r\nresults.&nbsp;</span></font></font></font><br></p>', '0425 207 073', 'http://www.zumbaunited.com.au', 'kopersonaltraining@yahoo.com', 'Classhopper | Zumba United Argyle St, St Kilda', 'Zumba United is operated by Keren Orbach in Argyle Street in St Kilda a