(50, 2, 5913, 'Flavours of Yoga', 'St Josephs Parish Hall - 47 Stanhope Street, Malvern 3144', 'Flavours of  Yoga specialises in beginners. The philosophy of this studio is that it is never too late to learn to be more coordinated, flexible and relaxed. You will not need to be able to touch your toes, do a hand stand or tie your body up in knots to get the benefits of  Fionas class. Fiona is dedicated to keeping it simple whilst still giving you all the benefits. Yoga does not have to be complicated.  Yoga should be fun just bring your sense of humour and you''re ready to begin.', '<strong>Yoga Stretch:</strong> Fionas classes merge, Yoga, Chi Gung, little kundalini, and the 5 tibetans. Each class is both energising and relaxing. Perfect for beginners or the student who wants a fun, yoga experience that is not too challenging. No headstands, no handstands but plenty to give you all the benefits of yoga.<br>', '0425 770 464', 'http://www.flavoursofyoga.com/', 'fiona@flavoursofyoga.com', 'Classhopper | Flavours of Yoga', 'Flavours of Yoga offer yoga classes for everyone from beginners to the more advanced and are operated by Fiona Edelstein at a beautiful studio in Malvern', 'yoga, fiona, fiona edelstein, malvern, yoga studio, beginner yoga, advanced yoga, flavours of yoga, melbourne, yoga class, yoga classes, stretch yoga, stretch, melbourne', -37.85805680, 145.03130350, 1, '2015-05-13 08:46:59', '2015-05-18 11:18:09'),
(51, 1, 746, 'Outdoor Squad @ Redfern', 'Redfern Park', '<p>We work with people of all ages and fitness levels to provide accountability, support and motivation in a fun bootcamp fitness session.\r\n\r\nOur highly qualified trainers use the latest in sports science to make your boot camp experience productive, varied and enjoyable.\r\n</p><p>\r\nIf you want to get fit, lose weight, tone up and improve your strength, we can help you like weve helped others.\r\n\r\nUsing functional fitness tools including kettlebells, powerbags, dumbbells, battleropes, medicine balls, TRX suspension training, high intensity cardio drills including circuits, sprints, relays, intervals, hill and stair training, plus our popular non-contact boxing and kickboxing drills, you will experience a cross training effect like no other.\r\n</p><p>\r\nOur clients use the unique training at Outdoor Squad to simply improve their life. Some come to improve their mood, reduce stress, meet new people, have more energy. Others use the training to enter fun runs, marathons, obstacle races such as Tough Mudder and Spartan Race, Ironman, and generally train a better body to do more and go further.</p>', '', ' 0409 537 743', 'http://outdoorsquad.com.au/', 'info@outdoorsquad.com.au', 'Classhopper | Outdoor Squad Redfern', 'We work with people of all ages and fitness levels to provide accountability, support and motivation in a fun bootcamp fitness session.', 'bootcamp, outdoor squad, redfern, sydney, fitness, wellness, kettlebells, powerbags, dumbbells, battleropes, medicine balls, TRX suspension training, high intensity cardio drills including circuits, sprints, relays, intervals, hill training, stair training', -33.89454520, 151.20623720, 1, '2015-05-15 12:13:29', '2015-05-16 11:00:38'),
(53, 2, 6069, 'Melbourne Sports & Aquatic Centre (MSAC)', '1 Aughtie Drive, Albert Park VIC 3206', 'The Hot Yoga studio at Melbourne Sports &amp; Aquatic Centre (MSAC) is heated to 38 degrees to help you sweat, detoxify and deepen your practise, challenging your body and calming your mind. ', '<strong>Hot Vinyasa Yoga:</strong> These hot yoga classes are 60 mins long and practiced in a heated studio of up to 38 degrees. All the classes are based on Hot Vinyasa and are not Bikram. There are a number of different instructors who are all&nbsp; friendly and happy to help you progress.&nbsp; <br>', '13 13 14', 'http://www.melbournesportshub.com.au/msac/', 'RussellW@ssct.com.au', 'Classhopper | Melbourne Sports & Aquatic Centre (MSAC)', 'Melbourne Sports & Aquatic Centre (MSAC) in Albert Park offer Hot Vinyasa Yoga classes, which are heated to 38 degrees ', 'melbourne sports and aquatic centre, aquatic centre, sports centre, hot yoga, yoga, bikram yoga, bikram, melbourne, albert park, yoga class, yoga classes, beginner yoga, aquatic', -37.84586100, 144.96386000, 1, '2015-05-15 22:12:43', '2015-05-18 11:19:14'),
(54, 2, 5968, 'Pivotal Fitness', '56 Poath Road, Hughesdale Victoria', 'Pivotal Health and Fitness is a leading movement and wellness studio catering to traditional, hybrid and progressive movers.', '<strong>Bootcamp: </strong>Outdoor sessions designed to challenge you and give you a good time in a small group environment.<br>', '0400 848 175', 'http://www.pivotalfitness.com.au/', 'info@pivotalfitness.com.au', 'Classhopper | Pivotal Fitness Hughesdale', 'Pivotal Fitness is located on Poath Road in Hughesdale and offers morning outdoor bootcamp workout sessions in a small group environment', 'pivotal, fitness, pivotal fitness, hughesdale, poath, poath road, bootcamp, boot camp, group fitness, group exercise, outdoor, outdoor bootcamp, morning bootcamp, morning, melbourne', -37.89323480, 145.07701460, 1, '2015-05-16 00:18:11', '2015-05-18 11:22:53'),
(55, 2, 5714, 'Sparkly Yoga', 'Australian Shiatsu College - 103 Evans Street, Brunswick VIC 3056', 'Sparkly Yoga''s philosophy is that each time you walk out of a yoga class you''ll face the world with a refreshing ''spark'' in the eyes. Why just shine, when you can sparkle!', '<strong>Organic Flow: </strong>This is a flowing organic Hatha class focusing on core strength and flexibility with elements of pranayama and meditation.<br>', '0410 184 771', 'http://www.sparklyoga.com', 'michele@sparklyoga.com', 'Classhopper | Sparkly Yoga Brunswick', 'Sparkly Yoga classes at the Australian Shiatsu College in Brunswick offer Organic Flow Yoga for all levels', 'sparkly yoga, yoga, brunswick, australian shiatsu college, organic flow, organic yoga, flow yoga, melbourne, yoga classes', -37.77046420, 144.97111390, 1, '2015-05-16 00:57:38', '2015-05-18 11:21:39'),
(56, 2, 6025, 'Nia with Tiffany @ Highett', 'Highett Neighbourhood Community Centre - 3 Livingston Street, Highett Victoria 3190', 'Nia is for EveryBody!   It empowers people of all ages, shapes, sizes and fitness levels to connect to their body, mind, emotions and spirit by paying attention to sensation. You do not need coordination or experience. You just need the desire to move! Tiffany is passionate about wellbeing and strongly believes in Nias philosophy Through Movement we find Health. Wear comfortable clothes!', '<strong>Nia:</strong> Nia is based on the idea that exercise should feel good inside and out. Nia is a sensory-based practice that incorporates dance, martial arts and healing arts.&nbsp; Nia promotes mindfulness, holistic fitness and wellbeing. It gives us flexibility, agility, mobility, strength and stability. It feels good and is fun to do!<br>', '0459 992 213', 'http://www.niaaustralia.com.au/component/jomdirectory/206-Tiffany-Tyler-Dignam', 'niawithtiffany@gmail.com', 'Classhopper | Nia with Tiffany in Highett', 'Tiffany Tyler-Dignam''s Nia classes in Highett promote mindfulness, wellbeing and holistic fitness though a combination of dance and martial arts', 'tiffany, nia, highett, dance, dance studio, martial arts, fitness, healing, casual, melbourne, highett neighbourhood centre, neighbourhood centre', -37.94723600, 145.03797800, 1, '2015-05-16 01:05:50', '2015-05-18 11:23:33'),
(57, 2, 6000, 'Terry Bennett''s Gym', '1/259 St Chapel Street, Prahran Victoria 3181 ', 'Terry Bennett''s Gym is the oldest gym in Melbourne and prides itself on teaching a variety of authentic boxing and martial arts styles. If you want the real deal, come to Terry Bennett''s!', '<font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font face="Calibri" size="3">Kombokan\r\n(Filipino Martial Arts): </font></span></b><span style=''font-family: "Verdana",sans-serif; font-size: 10pt; mso-fareast-font-family: "Times New Roman"; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Kombokan (Kombat, Boksing at\r\nTadyakan) is a non-competitive, reality-based, freestyle, self-defense fighting\r\nsystem that is based on rapid striking. It has developed practical yet fast\r\nstriking moves that can also progress into grappling, take-downs (dumog) and\r\ndisarming by using all parts of the body.&nbsp;</span></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></b></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font color="#000000"><font size="3"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Boxing/Kickboxing:\r\n</span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>These classes are a combination of boxing and\r\nkickboxing, with a focus on high cardio fitness as well as one-on-one technique</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></b></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Kung Fu: </span></b></font><span style=''color: black; mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Kung Fu emphasizes qualities like\r\nendurance, perseverance, discipline, loyalty, and a calm disposition are\r\nprerequisites for progress, especially at higher levels. All these qualities,\r\nacquired through Kung Fu training, are transferable to daily life.</span></font></font><br></p>', '03 9533 6750 ', 'http://www.terrybennetts.com.au', 'terrybennettgym@optusnet.com.au', 'Classhopper | Terry Bennett''s Gym Prahran', 'Terry Bennett''s Gym in Prahran is the oldest gym in Melbourne and offer a variety of authentic boxing and martial arts styles ', 'terry bennett, terry bennetts, terry bennetts gym, prahran, gym prahran, boxing, mma, martial arts, mixed martial arts, fighting, boxing classes, kickboxing classes, martial arts classes, melbourne', -37.84934000, 144.99351200, 1, '2015-05-16 01:16:52', '2015-05-18 11:20:47'),
(58, 1, 817, 'Boot Camp Australia @ Haberfield', '215-217 Parramatta Road, Haberfield NSW 2045', '<p>Kent Pumpa shares his wealth of knowledge from over 15 years in the industry with his fantastic team of trainers. All of our programs are designed to get you, the client, MAXIMUM results in MINIMUM time. All camps and classes have a wide variety of activities that keep you coming back for more. These programs are designed for the beginner all the way through to the advance athlete. So if you are looking for something fun to start you on your road to success, or simply looking for something more, this is the place for you!\r\n</p><p>\r\nThe Boot Camps Australia program has been designed to give your body the ultimate workout. Each training session integrates diverse and dynamic exercise regimes and innovative activities. The program is designed to physically and mentally challenge you on an individual and team oriented level. Boot Camps Australia has been designed so that each challenge that you accomplish will take you another step closer towards improving your personal health and fitness, achieving your goals and continually accomplishing results.\r\n</p><p>As the Boot Camps Australia program is tailored to your needs, you will be placed into a team according to your level of health and fitness. Each team is coordinated by a Boot Camps Australia personal trainer, one of Australias most unique personal trainers. Your personal trainer will provide continual motivation and support to get you to achieve your goals and more importantly accomplish results.\r\nThe exercises and activities conducted in each Boot Camps Australia training session will focus on enhancing: core stability, cardio, endurance, hypertrophy, strength and conditioning and toning. Each Boot Camps Australia training session will comprise diverse activities and exercise, so that you can concentrate on enhancing the areas in which you wish to achieve maximum results.\r\n </p>', '', '02 8084 6775', 'http://www.bootcampsaustralia.com/affiliates/locations/nsw/haberfield/', 'bcahq@bootcampsaustralia.com', 'Classhopper | Bootcamp Australia @ Haberfield', 'As the Boot Camps Australia program is tailored to your needs, you will be placed into a team according to your level of health and fitness.', 'bootcamp, outdoor squad, haberfield, sydney, fitness, wellness, kettlebells, powerbags, dumbbells, battleropes, medicine balls, TRX suspension training, high intensity cardio drills including circuits, sprints, relays, intervals, hill training, stair training', -33.87825900, 151.13107800, 1, '2015-05-16 07:10:13', '2015-05-16 12:57:02'),
(59, 1, 825, 'Bootcamp Australia @ Five Dock', 'Five Dock Park, Park Road, Five Dock NSW 2046', '<p>Boot Camps Australia Drummoyne/Five Dock is owned by Kent Pumpa. He shares his wealth of knowledge from over 15 years in the industry with his fantastic team of trainers. </p><p>All of our programs are designed to get you, the client, MAXIMUM results in MINIMUM time. All camps and classes have a wide variety of activities that keep you coming back for more. These programs are designed for the beginner all the way through to the advance athlete. So if you are looking for something fun to start you on your road to success, or simply looking for something more, this is the place for you!</p>', '', '02 8084 6775', 'http://www.bootcampsaustralia.com/affiliates/locations/nsw/drummoynefive-dock/', 'bcahq@bootcampsaustralia.com', 'Classhopper | Bootcamp Australia @ Five Dock', '', '', -33.86768940, 151.13297520, 1, '2015-05-16 07:19:23', '2015-05-16 12:57:13'),
(60, 1, 721, 'Wholistic Personal Training (Women-only)', 'Liverpool Street & Elizabeth Street, Sydney', '\r\n\r\n\r\n\r\n\r\n<p style="line-height: 1.5;"><span style="font-family: Helvetica, Arial, sans-serif; font-size: 13px; line-height: 17px;">Wholistic Personal Training provides an all-encompassing approach to health and fitness. All packages focus on the three vital elements for long term health - fitness, nutrition &amp; self development.&nbsp;</span><span style="font-family: Helvetica, Arial, sans-serif; font-size: 13px; line-height: 17px;">Join a community of likeminded women who support each other and get amazing results.<br></span><span style="font-family: Helvetica;">Need to arrive to their first class 10mins early to fill in the Pre Exercise Form. Located behind Museum station in Hyde Park. Closest intersection is Livepool and Elizabeth streets. We are facing elizabeth street. Look out for the big blue wheeley bin. Ladies only.</span></p>', '', '0414775697	', 'http://wholisticpersonaltraining.com.au/', 'rhoda@wholisticpersonaltraining.com.au', 'Classhopper | Wholistic Personal Training Outdoor Bootcamps', 'Wholistic Personal Training Outdoor Bootcamps are conveniently located in Hyde Park at the heart of the Sydney CBD. ', 'bootcamp, outdoor squad, hyde park, sydney, fitness, wellness, kettlebells, powerbags, dumbbells, battleropes, medicine balls, TRX suspension training, high intensity cardio drills including circuits, sprints, relays, intervals, hill training, stair training', -33.87676770, 151.20942730, 1, '2015-05-16 10:48:42', '2015-05-21 07:40:15');
