(61, 1, 911, 'Peace Love Yoga @ Terrey Hills', 'Terrey Hills Swim School, 31 Myoora Road, Terrey Hills NSW 2084', '<p>Peace Yoga Love offers friendly community yoga classes in three locations on Sydney''s Northern Beaches - we have regularly scheduled yoga classes with experienced and knowledgeable yoga teachers. </p><p>We offer children''s and adults classes, two totally free classes every week and we also offer mums and bubs classes. There is no expectation of skill level, yoga clothes, body shape, age, fitness level or any other judgement. Our classes are all drop in, there are no bookings, no terms and no catches. </p><p>Our classes will suit beginner through to experienced yoga students. Peace Yoga Love is run by Min, who is absolutely passionate about Yoga being accessible and affordable to everyone, as it should be! We have old people, young people, inflexible people and bendy people, beginners and everyone in between in our classes - and that is just the way we like it. Please come and join us for a class.</p>', '', '0405 366 966', 'http://www.peaceyogalove.com/', 'peaceyogalovemin@gmail.com', 'Classhopper | Peace Love Yoga Terrey Hills', '', '', -33.68978142, 151.21968269, 1, '2015-05-16 11:28:04', '2015-05-16 11:51:05'),
(62, 1, 937, 'Peace Love Yoga @ Freshwater', 'Mona Vale Surf Club, Mona Vale NSW 2103', '<p>At Peace Yoga Love our philosophy is to make yoga affordable to everyone and especially the most vulnerable in our community. Peace Yoga Love offers friendly community yoga classes in three locations on Sydney''s Northern Beaches - we have regularly scheduled yoga classes with experienced and knowledgeable yoga teachers.</p><p>We offer children''s and adults classes, two totally free classes every week and we also offer mums and bubs classes. There is no expectation of skill level, yoga clothes, body shape, age, fitness level or any other judgement. Our classes are all drop in, there are no bookings, no terms and no catches.</p><p>Our classes will suit beginner through to experienced yoga students. Peace Yoga Love is run by Min, who is absolutely passionate about Yoga being accessible and affordable to everyone, as it should be! We have old people, young people, inflexible people and bendy people, beginners and everyone in between in our classes - and that is just the way we like it. Please come and join us for a class.</p><p>Please bring your own mat and towel.</p>', '', '0405 366 966', 'http://www.peaceyogalove.com/', 'peaceyogalovemin@gmail.com', 'Classhopper | Peace Love Yoga Freshwater', '', '', -33.67798780, 151.30334200, 1, '2015-05-16 11:37:58', '2015-05-16 12:08:22'),
(63, 1, 959, 'Peace Love Yoga @ Mona Vale', ' Mona Vale Surf Club, Surfview Road, Mona Vale NSW 2103', '<p>Peace Yoga Love offers friendly community yoga classes in three locations on Sydney''s Northern Beaches - we have regularly scheduled yoga classes with experienced and knowledgeable yoga teachers.</p><p>We offer children''s and adults classes, two totally free classes every week and we also offer mums and bubs classes. There is no expectation of skill level, yoga clothes, body shape, age, fitness level or any other judgement. Our classes are all drop in, there are no bookings, no terms and no catches.</p><p>Our classes will suit beginner through to experienced yoga students. Peace Yoga Love is run by Min, who is absolutely passionate about Yoga being accessible and affordable to everyone, as it should be! We have old people, young people, inflexible people and bendy people, beginners and everyone in between in our classes - and that is just the way we like it. Please come and join us for a class.</p>', '', '0405 366 966', 'http://www.peaceyogalove.com/', 'peaceyogalovemin@gmail.com', 'Classhopper | Peace Love Yoga Mona Vale', '', '', -33.67826310, 151.31350730, 1, '2015-05-16 11:40:07', '2015-05-16 11:51:10'),
(64, 1, 750, 'Ultimate Pilates', 'Unit 103, 30-40 Harcourt Parade Rosebery NSW 2018', '<p>We are a Functional Training &amp; High Performance Pilates Centre in Sydney. We specialise in physical development &amp; weight management. </p><p>Everything we offer is aimed at delivering an aesthetically pleasing physical presence. Whether you''re after muscle development, toning and conditioning or weight management, we''ve got you covered from head to toe. </p><p>Our programs comprehensively cover high performance reformer training, Bow muscle development &amp; shape training, TRX suspension training for strength, conditioning and core management.</p>', '<ul><li>Pilates classes 1</li><li>Pilates classes 2</li></ul>', '0429 230 670', 'http://www.ultimatepilates.com.au/home.html', 'info@ultimatepilates.com.au', 'Classhopper | Ultimate Pilates Rosebery', '', '', -33.91996400, 151.20271900, 1, '2015-05-16 12:32:26', '2015-05-18 09:55:01'),
(65, 2, 5907, 'Core Candy @ South Yarra', 'Level 1, 349 Chapel Street, South Yarra VIC 3141', '<p>Core Candy is a boutique fitness studio in Melbourne, inspired by the vibrant fitness scene of New York. We deliver fun, addictive, body-changing workouts in a motivating, small class environment. </p><p>Our classes offer something for everyone and for every mood  we have Ballet Barre workouts, high intensity, functional training workouts (HIIT), Pilates Springboard and Yoga. All classes are created from sound Pilates principles to ensure that they are as safe as possible. No fitness, dance or other experience is required for any class  our instructors expertly modify exercises or demonstrate alternatives to ensure that you get the most out of your class, no matter your gender or level of experience. We are not a gym. </p><p>Our two light filled studio rooms (the Grace Studio and Grit Studio) have been custom made  think luxe, Tribeca apartment rather than a smelly, cooker cutter gym. Our studio is intimate, not intimidating, our music is motivating, our instructors are expert and encouraging and classes are spirited, challenging and fun.</p>', '<font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Barre:</span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''> Barre is a fun and vivacious class designed to\r\nstrengthen, tone and balance the whole body, as well as increase your\r\nflexibility. This class focuses on your core, arms, seat, legs and thighs,\r\nfollowed by stretching to lengthen out your worked muscles. It draws elements\r\nfrom ballet, Pilates, and cardio dance, all set to popular and energetic music.\r\nIntegrated into each class is the use of light weights, therabands, small balls\r\nand of course the ballet barre. </span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Pilates\r\nSpringboard:</span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''> These classes bring a new challenge of spring\r\nresistance to your Pilates experience (and perfectly fine for beginners!). The\r\ndifferent spring tensions are used to strengthen and tone your body as well as\r\nimprove your core stability. A lot of Pilates work is done lying down and the\r\nSpringboard allows you to be up on your feet, perfecting your posture and\r\nbalance.</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Accelerate\r\nHIIT:</span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''> This class consists of quick, intense bursts of\r\nexercise followed by active recovery which gets your heart pumping, boosts your\r\nmetabolism and allows you to burn calories for many hours after you''ve left the\r\nstudio. This class incorporates cardio and strength training with the use of\r\nPilates springs, kettle bells, medicine balls and resistance bands. Every day\r\noffers a new combination of exercises and props to always keep you on your\r\ntoes, avoid boredom and to completely challenge the total body. You will sweat,\r\na lot. You will also increase your endurance, strength and flexibility and\r\nrapidly accelerate toward goals you didn''t even know you had. Empower\r\nyourself!&nbsp;Wear running shoes or trainers to this class!</span></font></font></font></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''><font color="#000000" face="Calibri" size="3">&nbsp;</font></span></p><font color="#000000" face="Times New Roman" size="3">\r\n\r\n</font><p style="margin: 0cm 0cm 0pt; line-height: normal;"><font face="Calibri"><font size="3"><font color="#000000"><b style="mso-bidi-font-weight: normal;"><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''>Yoga:</span></b><span style=''mso-ascii-font-family: Calibri; mso-fareast-font-family: "Times New Roman"; mso-hansi-font-family: Calibri; mso-bidi-font-family: "Times New Roman"; mso-fareast-language: EN-AU;''> These vinyasa power flow classes focus&nbsp;on\r\nbuilding and developing concentration, body awareness, physical coordination,\r\nbalance and strength.&nbsp;Using your breath to inspire your movement and calm\r\nyour mind, you&nbsp;will leave feeling powerful,&nbsp;rejuvenated and inspired.</span></font></font></font><br></p>', '0403 655 219', 'http://www.corecandy.com.au/', 'info@corecandy.com.au', 'Classhopper | Core Candy South Yarra', 'Core Candy is a New York style boutique fitness studio located in South Yarra, which specialises in Barre, Pilates, high intensity interval training (HIIT) group fitness classes', 'boutique fitness studio, fitness, fitness studio, south yarra, barre, pilates, high intensity interval training, HIIT, group fitness, fitness classes, springboard pilates, casual, melbourne', -37.84657950, 144.99393730, 1, '2015-05-16 14:30:07', '2015-05-18 10:30:46'),
(67, 0, 1282, 'Primal FHN', 'Unit 9A, 1-3 Endeavour Rd, Caringbah, NSW, 2229 ', '<p>Let me introduce you to the Primal Fitness Studio located in Caringbah, Sydney. We are a holistic fitness studio offering Primal Body Transformations via functional training. This is all conducted in our comfortable, unique and high vibe studio by highly skilled and professional trainers. </p><p>At Primal, we take our clients through a transformational journey, where we help them to gradually strip back the undesired modern influences of their current lifestyle to reveal their natural self. We dont look like your regular gym and we don''t approach fitness in the standard way. </p><p>Primal Lifestyle &amp; Fitness Studio incorporates weighted natural movement and natural nutrition, alongside specific tools and techniques to help bring our clients back to natural body mobility. Each studio provides knowledgeable staff, functional training equipment and products to carry out the Primal Lifestyle framework that has been created to guide each client through the integration of clean living. Our purpose is to provide clients with a fun, enlightening and energising studio environment where they can get a great workout and have access to lifestyle products that enrich their lives.&nbsp;<br></p>', '<p><br></p>', '02 8502 8410', 'http://www.primalfhn.com.au/', 'admin@primalfhn.com.au', 'Classhopper | Primal FHN', 'We take a holistic approach to health and fitness. With a great vibe in the studio, it is a place where you can fully relax and be yourself while working to reach your full potential', 'home, primal, fitness, healing, nutrition, social, mind, body, soul, classhopper', -34.03060400, 151.13041400, 1, '2015-05-18 07:40:18', '2015-05-18 07:40:18'),
(70, 0, 758, '6 Weeks To Sexy', '30 Alma Rd, Paddington, NSW', '<p style="margin-bottom: 1.28571428571429rem; padding: 0px; border: 0px; color: rgb(0, 0, 0); font-family: ''Open Sans'', Helvetica, Arial, sans-serif; line-height: 24px;">6w2s (6 weeks to sexy) was founded in April 2012 by Blake Worrall-Thompson who had a goal &nbsp;<strong style="margin: 0px; padding: 0px; border: 0px;">to create a happy, positive and motivating environment for women to get fit, lose weight, feel healthy and have fun</strong>.</p><p style="margin-bottom: 1.28571428571429rem; padding: 0px; border: 0px; color: rgb(0, 0, 0); font-family: ''Open Sans'', Helvetica, Arial, sans-serif; line-height: 24px;">Since 2012, Blake and his team of trainers in Adelaide and Sydney&nbsp;<strong style="margin: 0px; padding: 0px; border: 0px;">have transform the lives of over 1100 women</strong>&nbsp;and helped empower them to take charge of their own lives and make long term change.</p>', '<p style="margin-bottom: 1.28571428571429rem; padding: 0px; border: 0px; color: rgb(0, 0, 0); font-family: ''Open Sans'', Helvetica, Arial, sans-serif; line-height: 24px;">The 6w2s program&nbsp;<span style="font-weight: 700; margin: 0px; padding: 0px; border: 0px;">caters to women of all shapes and sizes and all levels of fitness</span>&nbsp; whether youre a complete beginner or more advanced.</p><p style="margin-bottom: 1.28571428571429rem; padding: 0px; border: 0px; color: rgb(0, 0, 0); font-family: ''Open Sans'', Helvetica, Arial, sans-serif; line-height: 24px;">The 6w2s trainers have worked with women from all walks of life  from the bridesmaid who wants to lose the last 5 kilos before her wedding, to the mother of two who wants to get rid of her pre baby weight to the corporate women who wants to feel fit again.</p>', '1300 80 40 92', 'http://www.6weekstosexy.com.au/', 'blake@mowb.com.au', 'Classhopper | 6 Weeks to Sexy', '', '', -33.87910300, 151.23115700, 1, '2015-05-18 11:34:07', '2015-05-18 11:34:07'),
(71, 0, 3382, 'Beachside Personal Trainers', '1 Brigadoon Circuit, Oak Flats NSW 2529', '<p>WELCOME TO BEACHSIDE </p><p>Its time to lace up your joggers, grab your drink bottle and meet us down at the beach. If you want to improve your lifestyle by having fun and becoming more active, by eating healthy food and enjoying cooking again, by meeting new friends and being part of a team and by dreaming big and achieving goals you never thought you could then come and give Beachside a go. </p><p>We specialise in fat loss (toning), increasing your fitness and maintaining a healthy active lifestyle for you and your family through fun and challenging Group Training sessions and focused and committed Personal Training sessions.</p>', '<h1 style="-webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility; font-size: 1.8em; margin-top: 0px; margin-bottom: 0.67em; font-family: ''Open Sans'', ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: 1.6em; letter-spacing: 0.2em; text-transform: uppercase; color: rgb(68, 68, 68);">BOOTCAMP</h1><article id="post-1353" class="post-1353 service type-service status-publish has-post-thumbnail hentry division-group-training" style="-webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility; color: rgb(68, 68, 68); font-size: 15.3999996185303px; line-height: 24.6399993896484px;"><p style="-webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility;">Beachside Bootcamp Shellharbour is a fun, sociable way to get fit, build friendships and lead a more active, healthier lifestyle.</p><p style="-webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility;">Our sessions are centered on individual and team progressions in fitness and health week to week, helping you to achieve your fitness and weight loss goals. Well engage in a variety of exercises differentiated to meet the needs of all individuals, no matter your fitness level, so that nobody is held back, nor left behind. Youll be amazed at how fast your fitness will progress once you start working your body!</p><h1 style="-webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility; font-size: 1.8em; margin-top: 0px; margin-bottom: 0.67em; font-family: ''Open Sans'', ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: 1.6em; letter-spacing: 0.2em; text-transform: uppercase; color: rgb(68, 68, 68);">RUN GROUP</h1><article id="post-1342" class="post-1342 service type-service status-publish has-post-thumbnail hentry division-group-training" style="-webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility; font-size: 15.3999996185303px; line-height: 24.6399993896484px;"><p style="-webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility;">Beachside Run Group Shellharbour will get you running faster and further! Whether you are a complete novice who wants to learn how to&nbsp; run or a beginner runner who wants to push yourself that little bit more, Beachside Run Group Shellharbour will get you moving and loving it!</p><p style="-webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility;">Improve your fitness, your running technique and smash those running goals as a part of our supportive, like-minded team. Gone are the days of trying to find the motivation to go for a run or feeling like a failure because you can barely hold a jog for 30 seconds. Beachside Run Group Shellharbour caters for all levels of fitness, tracks your progress so you can see improvement and best of all, provides you with a network of social runners so you can be a part of our team for fun-runs and events.</p><h1 style="-webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility; font-size: 1.8em; margin-top: 0px; margin-bottom: 0.67em; font-family: ''Open Sans'', ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: 1.6em; letter-spacing: 0.2em; text-transform: uppercase; color: rgb(68, 68, 68);">FIT MUMS</h1><article id="post-1433" class="post-1433 service type-service status-publish has-post-thumbnail hentry division-group-training" style="-webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility; font-size: 15.3999996185303px; line-height: 24.6399993896484px;"><p style="-webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility;">At Beachside Fit Mums Shellharbour we know the importance of family. And we also know how important being a healthy happy Mum is to have a healthy happy family. There is so much pressure on Mums these days to be everything and do everything, but we want you to know that youre not alone. Beachside has your back and wed love to help you out.</p><p style="-webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility;">Our Fit Mums classes are aimed at tightening your core and midsection and brining everything back together, stripping back the baby weight that was vital during pregnancy but is now just a nuisance, building your fitness to keep up with your little one and gaining strength in your core, back and other ares of your body needed for the demands of day to day living.</p><p style="-webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility;">But your mind is just as important as your body and at Beachside we have a fantastic, supportive and helpful group of members and mums that you can talk to, get advice from and lean on when you need it (not just from a hard workout).</p><p style="-webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility;">Dont worry about a baby sitter or a crche. We think its great for babies and children to see their mums exercising and making physical activity part of their lifestyles, so bring them along and they can be right there with us every step of the way. We love to see the kids and even babies start doing push-ups and squats along with us!</p><h1 style="-webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility; font-size: 1.8em; margin-top: 0px; margin-bottom: 0.67em; font-family: ''Open Sans'', ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: 1.6em; letter-spacing: 0.2em; text-transform: uppercase; color: rgb(68, 68, 68);">RUN GROUP</h1><article id="post-1342" class="post-1342 service type-service status-publish has-post-thumbnail hentry division-group-training" style="-webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility; font-size: 15.3999996185303px; line-height: 24.6399993896484px;"><p style="-webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility;">Beachside Run Group Shellharbour will get you running faster and further! Whether you are a complete novice who wants to learn how to&nbsp; run or a beginner runner who wants to push yourself that little bit more, Beachside Run Group Shellharbour will get you moving and loving it!</p><p style="-webkit-font-smoothing: antialiased; text-rendering: optimizeLegibility;">Improve your fitness, your running technique and smash those running goals as a part of our supportive, like-minded team. Gone are the days of trying to find the motivation to go for a run or feeling like a failure because you can barely hold a jog for 30 seconds. Beachside Run Group Shellharbour caters for all levels of fitness, tracks your progress so you can see improvement and best of all, provides you with a network of social runners so you can be a part of our team for fun-runs and events.</p></article></article></article></article>', '', 'www.beachsidepersonaltrainers.com', 'info@beachsidepersonaltrainers.com', 'Classhopper | Beachside Personal Trainers', 'Beachside Personal Trainers The Best Way to Burn Fat off Your Stomach, Tone Your Thighs, Sculpt Your Arms and Have You in the Best Shape of Your Life!', '', -34.56499426, 150.86812019, 1, '2015-05-20 03:58:30', '2015-05-20 03:58:30'),
(74, 0, 892, 'Bootcamps Australia @ Hornsby', '24 Valley Road, Hornsby, NSW', '<p>Boot Camps Australia Hornsby is owned by Jason Winter . He shares his wealth of knowledge from being involved with training from several different area''s . All of his programs are designed to get you,the client MAXIMUM results in MINIMUM time.</p><p>All camps and classes have a wide variety of activities that keep you coming back for more these programs are designed for beginners all the way through to the advanced athlete .So if your looking for something fun to start you on your road to success , or simply looking for something more,this is the place for you ! Come down and give it a go TODAY!</p>', 'Outdoor innovative functional training which works your cardio, core and physical fitness like no other.', ' 0403 335 497', 'http://www.bootcampsaustralia.com/affiliates/locations/nsw/hornsby/', 'hornsby@bootcampsaustralia.com', 'Classhopper | Bootcamp Australia @ Hornsby', '', '', -33.70204900, 151.08045200, 1, '2015-05-20 05:29:22', '2015-05-20 05:30:43'),
(75, 0, 735, 'Kaizen Fitness', 'Moore Park, Sydney, NSW', '<div><div><br></div><div>Kaizen fitness provides a variety of bootcamps designed to shock your body into burning up to 700 calories per session. So if your goal is to lose weight, feel great and get in the best shape of your life, look no further. Our high intensity sessions are guaranteed to burn fat fast and leave you with that lean and sexy body youve always dreamed of!</div><div><br></div><div>As kaizen is a japanese word which describes continuous improvement in performance, we at kaizen fitness understand that for your health and fitness to continuously improve it must be exposed to a variety of training types. Therefore our focus is to develop your technique by utilizing an array of fitness equipment!</div><div><br></div></div><div>Our bootcamps will develop and improve all aspects of your fitness  strength, endurance, speed, flexibility and power.</div><div><br></div><div>Our supportive trainers will motivate you to get the very best out of your body. We provide progressions and regressions to all our exercises, creating fun and effective workouts for all levels of fitness.</div>', '', '', 'http://www.kaizenfitness.com/sydney-bootcamp/', 'lukebardsley@rocketmail.com', 'Classhopper | Kaizen Fitness', '', '', -33.90092910, 151.21526630, 1, '2015-05-20 05:41:04', '2015-05-20 05:45:16'),
