s\r\n  are run outdoors. Sessions are suitable for all ages and fitness levels. At\r\n  Boot Camps Australia the focus is on team work to ensure no one is left\r\n  behind.</font></td></tr></tbody></table>', '0423 139 103', 'http://www.bootcampsaustralia.com/', 'rowville@bootcampsaustralia.com', 'Classhopper | Boot Camps Australia Rowville', 'Boot Camps Australia at Eildon Park in Rowville offer outdoor boot camp group fitness classes to suit all fitness levels', 'boot camps, boot camps australia, boot camp, group fitness, fitness classes, rowville, eildon park, outdoor, outdoor exercise, outdoor bootcamp, casual, melbourne', -37.91810110, 145.25285410, 1, '2015-05-20 09:16:26', '2015-05-20 12:59:43'),
(78, 2, 5999, 'Boot Camps Australia @ Knoxfield', 'Carrington Park, Knoxfield VIC 3180', '<font color="#000000" face="Times New Roman" size="3">\r\n </font><font color="#000000" face="Times New Roman" size="3">\r\n </font><font color="#000000" face="Times New Roman" size="3">\r\n\r\n  </font><font color="#000000" face="Times New Roman" size="3">\r\n\r\n </font><font color="#000000" face="Times New Roman" size="3">\r\n</font><table width="427" style="width: 320pt; border-collapse: collapse;" border="0" cellspacing="0" cellpadding="0"><colgroup><col width="427" style="width: 320pt; mso-width-source: userset; mso-width-alt: 15616;"></colgroup><tbody><tr height="24" style="height: 18pt; mso-height-source: userset;"><td width="427" height="24" style="border: 0px black; border-image: none; width: 320pt; height: 18pt; background-color: transparent;"><font color="#000000" face="Calibri" size="3">Whether\r\n  you want to lose weight, get fitter or toned Boot Camps Australia can help\r\n  you. Suitable to all fitness levels and ages, everyone is made to feel\r\n  welcome.&nbsp;Offering a variety of classes and styles to suit everyone.</font></td></tr></tbody></table>', '<font color="#000000" face="Times New Roman" size="3">\r\n </font><font color="#000000" face="Times New Roman" size="3">\r\n </font><font color="#000000" face="Times New Roman" size="3">\r\n\r\n  </font><font color="#000000" face="Times New Roman" size="3">\r\n\r\n </font><font color="#000000" face="Times New Roman" size="3">\r\n</font><table width="689" style="width: 517pt; border-collapse: collapse;" border="0" cellspacing="0" cellpadding="0"><colgroup><col width="689" style="width: 517pt; mso-width-source: userset; mso-width-alt: 25197;"></colgroup><tbody><tr height="20" style="height: 15pt;"><td width="689" height="20" style="border: 0px black; border-image: none; width: 517pt; height: 15pt; background-color: transparent;"><font color="#000000" face="Calibri" size="3"><strong>Bootcamp: </strong>Boot camp sessions\r\n  are run outdoors. Sessions are suitable for all ages and fitness levels. At\r\n  Boot Camps Australia the focus is on team work to ensure no one is left\r\n  behind.</font></td></tr></tbody></table>', '0423 139 103', 'http://www.bootcampsaustralia.com/', 'rowville@bootcampsaustralia.com', 'Classhopper | Boot Camps Australia Knoxfield', 'Boot Camps Australia at Carrington Park in Knoxfield offer outdoor boot camp group fitness classes to suit all fitness levels', 'boot camps, boot camps australia, boot camp, group fitness, fitness classes, carrington park, knoxfield, outdoor, outdoor exercise, outdoor bootcamp, casual, melbourne', -37.89492180, 145.24381760, 1, '2015-05-20 09:22:51', '2015-05-20 12:59:50'),
(79, 1, 718, 'DanceKool @ City', 'Dancekool City Level 2/319 Sussex Street Haymarket, NSW 2000', '<div>Maybe youve never danced before in your life but want to be able to get down at the clubs? Maybe you like Hip Hop music and culture and want to find out more about the dancing side? Maybe you know about Hip Hop styles, but want to learn more about the technical side of Popping or Breaking? Maybe youve been dancing for years and want to meet other people interested in the same thing that you love.&nbsp;</div><div><br></div><div>Whatever the reason you are in the RIGHT place! Dancekool is the first and finest street dance studio in Sydney. Founded in 2002 as the only studio focused around hip hop, over the years we have developed a reputation for authentic street styles and professional teaching.&nbsp;</div><div>Our experienced international family of instructors have learned from the best and have taught and performed all over the world from Japan to the US, China to the Philippines. All have extensive expertise in Hip Hop, Popping, Locking, Breaking, House and Street Jazz and are ready to teach you how to be a great dancer.&nbsp;</div><div><br></div><div>All levels from Absolute beginners to Advanced are offered as well as Basic and Performance courses throughout the year in the different styles. In addition Dancekool instructors regularly hold private classes and workshops to supplement regular classes.&nbsp;</div>', '', '', 'www.dancekool.com', 'info@dancekool.com', 'Classhopper | DanceKool @ City', '', '', -33.87507710, 151.20422790, 1, '2015-05-21 07:35:57', '2015-05-21 07:35:57'),
(80, 1, 1014, 'DanceKool @ Epping', '1/47 Beecroft Road, Epping 2121', '', '<div>Maybe youve never danced before in your life but want to be able to get down at the clubs? Maybe you like Hip Hop music and culture and want to find out more about the dancing side? Maybe you know about Hip Hop styles, but want to learn more about the technical side of Popping or Breaking? Maybe youve been dancing for years and want to meet other people interested in the same thing that you love.&nbsp;</div><div><br></div><div>Whatever the reason you are in the RIGHT place! Dancekool is the first and finest street dance studio in Sydney. Founded in 2002 as the only studio focused around hip hop, over the years we have developed a reputation for authentic street styles and professional teaching.&nbsp;</div><div>Our experienced international family of instructors have learned from the best and have taught and performed all over the world from Japan to the US, China to the Philippines. All have extensive expertise in Hip Hop, Popping, Locking, Breaking, House and Street Jazz and are ready to teach you how to be a great dancer.&nbsp;</div><div><br></div><div>All levels from Absolute beginners to Advanced are offered as well as Basic and Performance courses throughout the year in the different styles. In addition Dancekool instructors regularly hold private classes and workshops to supplement regular classes.&nbsp;</div>', '', 'www.dancekool.com', 'info@dancekool.com', 'Classhopper | DanceKool @ Epping', '', '', -33.77327820, 151.08157770, 1, '2015-05-21 07:37:48', '2015-05-21 07:37:48'),
(81, 1, 1214, 'Bootcamps Australia @ Marrickville', 'Corner of Livingstone & Frazer Street, Marrickville, NSW 2204', 'All of our programs are designed to get you, the client, MAXIMUM results in MINIMUM time. All camps and classes have a wide variety of activities that keep you coming back for more. These programs are designed for the beginner all the way through to the advance athlete. So if you are looking for something fun to start you on your road to success, or simply looking for something more, this is the place for you!', '<p>BOOT CAMP  Outdoor innovative functional training that works your cardio, core and physical fitness like no other. </p><p>FIGHT CIRCUIT (BOXING)  Designed for the fighter in you. Punch and kick your way through a class that will have you burning up a sweat and shredding calories in no time.</p>', '', 'http://www.bootcampsaustralia.com/media/1400/bc-timetable.pdf', 'marrickville@bootcampsaustralia.com', 'Classhopper | Bootcamp Australia @ Marrickville', '', '', -33.90154670, 151.15339900, 1, '2015-05-22 07:43:33', '2015-05-22 07:43:33'),
(82, 1, 949, 'CrossFit SPS Brookvale', '20 Wattle Road BROOKVALE NSW 2100', 'CrossFit SPS Brookvale is an amalgamation of ideas surrounding the fitness of everyday people, young prospects, avid sports enthusiasts, elite athletes and competitors. We strive to provide a playground of equipment not generally found at a traditional gym. The movements and skills that we teach at CrossFit SPS Brookvale are an eclectic mix of cardio, gymnastics, olympic lifting, strongman events, kettlebells, ropes, monkey bars, medicine balls and more. Each of these has cardio, strength and conditioning applications for everyone.', '', '', 'http://www.crossfitbrookvale.com.au/', 'info@crossfitsps.com.au', 'Classhopper | CrossFit SPS Brookvale', '', '', -33.76795280, 151.27686710, 1, '2015-05-22 07:51:04', '2015-05-22 07:51:04'),
(83, 1, 977, 'K-FiTT Personal Training', 'Boronia Park Oval, Park Road, Hunters Hill NSW 2110', '<p><span style="font-weight: bold;">REAL WOMEN, REAL RESULTS!</span></p><p> KFiTT Personal Training is specialised Training By Women, For Women! We offer fitness solutions to suit any goal and packages to suit every budget! KFiTT will help you lose weight, Get Fit, Tone up and you will have a Fun time doing it!! Make your dreams become reality today!</p>', '', '', 'http://k-fittpt.com.au/', 'emma@k-fittpt.com.au', 'Classhopper | K-FiTT @ Hunters Hill', '', '', -33.82610330, 151.13959140, 1, '2015-05-22 07:53:08', '2015-05-22 07:53:08');
